INSERT INTO `product` VALUES (94,'Đồng hồ thông minh Apple Watch Ultra LTE 49mm dây Alpine',_binary 'data:image/jpeg;base64,','ON',16,'2023-10-23 17:28:10','2023-11-01 17:42:49','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary '.....',_binary '\0'),(95,'Đồng hồ thông minh Apple Watch S8 GPS ',_binary 'data:image/png;base64,','ON',16,'2023-10-23 17:37:17','2023-10-24 09:57:12','ADMIN','trieuldhph15903@fpt.edu.vn',_binary '\0',_binary '.....',_binary '\0'),(96,'Đồng hồ thông minh Samsung Galaxy Watch5',_binary 'data:image/jpeg;base64,','ON',15,'2023-10-24 09:45:50','2023-10-24 17:59:17','ADMIN','trieuldhph15903@fpt.edu.vn',_binary '\0',_binary '>Thiết kế năng động, độ bền chuẩn qu&acirc;n đội Hoa Kỳ&nbsp;</h3>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-samsung-galaxy-watch-5\" target=\"_blank\" title=\"Xem thêm mẫu đồng hồ thông minh Galaxy Watch5 đang bán tại thegioididong.com\">Đồng hồ Galaxy Watch5</a>&nbsp;kh&ocirc;ng c&oacute; nhiều thay đổi về mặt thiết kế so với thế hệ trước, vẫn l&agrave; mặt đồng hồ tr&ograve;n được v&aacute;t phẳng h&agrave;i h&ograve;a kết hợp&nbsp;<strong>khung viền hợp kim nh&ocirc;m</strong>&nbsp;cứng c&aacute;p, tạo cảm gi&aacute;c năng động c&ugrave;ng sự hiện đại khi đeo tr&ecirc;n tay.&nbsp;<a href=\"https://www.thegioididong.com/samsung\" target=\"_blank\" title=\"Tham khảo các sản phẩm Samsung kinh doanh tại Thegioididong.com\" type=\"Tham khảo các sản phẩm Samsung kinh doanh tại Thegioididong.com\">Samsung</a>&nbsp;cũng đ&atilde; thay thế chất liệu k&iacute;nh cường lực bằng&nbsp;<strong>k&iacute;nh Sapphire</strong>&nbsp;cho thế hệ Watch5 gi&uacute;p tăng độ cứng c&aacute;p cho m&agrave;n h&igrave;nh, hạn chế nứt vỡ, trầy xước trong qu&aacute; tr&igrave;nh sử dụng.</p>\n\n<p>M&agrave;n h&igrave;nh&nbsp;<strong>1.2 inch</strong>&nbsp;c&oacute; độ ph&acirc;n giải&nbsp;<strong>396 x 396 pixels</strong>, mật độ điểm ảnh&nbsp;<strong>330 ppi</strong>&nbsp;mang đến độ chi tiết cao. C&ocirc;ng nghệ m&agrave;n h&igrave;nh&nbsp;<strong>Super AMOLED</strong>&nbsp;nổi tiếng của nh&agrave; Samsung mang đến m&agrave;u sắc sống động, nịnh mắt c&ugrave;ng khả năng hiển thị sắc n&eacute;t. D&acirc;y đeo silicone mềm mại, tho&aacute;ng kh&iacute; mang lại sự dễ chịu cho cổ tay cả ng&agrave;y d&agrave;i.',_binary '\0'),(97,'Đồng hồ thông minh Apple Watch SE 2022 GPS 40mm',_binary 'data:image/jpeg;base64,','ON',16,'2023-10-24 09:56:59','2023-11-01 17:43:04','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary 'Đồng hồ th&ocirc;ng minh Apple Watch SE 2022 GPS 40mm',_binary '\0'),(98,'Đồng hồ thông minh Apple Watch S8 GPS 45mm',_binary 'data:image/jpeg;base64,','ON',16,'2023-10-24 17:56:36','2023-11-01 17:43:13','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary '>Tiếp nối th&agrave;nh c&ocirc;ng của Apple Watch Series 7, nh&agrave; T&aacute;o đ&atilde; tr&igrave;nh l&agrave;ng thế hệ smartwatch tiếp theo của m&igrave;nh mang t&ecirc;n&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh/apple-watch-s8\" target=\"_blank\" title=\"Đồng hồ thông minh Apple Watch S8 tại thegioididong.com\">Apple Watch S8 GPS 45mm</a>&nbsp;tại sự kiện ra mắt sản phẩm thường ni&ecirc;n, hứa hẹn vẫn sẽ l&agrave; m&oacute;n phụ kiện đ&aacute;ng mong đợi với iFans v&agrave; người d&ugrave;ng đam m&ecirc; c&ocirc;ng nghệ.</h3>\n\n<h3>Kiểu d&aacute;ng thời thượng, dẫn đầu xu hướng</h3>\n\n<p>Nh&igrave;n tổng thể, Apple Watch S8&nbsp;vẫn mang diện mạo kh&ocirc;ng c&oacute; nhiều thay đổi so với c&aacute;c thế hệ tiền nhiệm. Tuy vậy,&nbsp;n&oacute; vẫn mang độ nhận diện cao với thiết kế m&agrave;n h&igrave;nh lớn c&ugrave;ng 4 cạnh bo tr&ograve;n thanh lịch.</p>\n\n<p>Được trang bị tấm nền&nbsp;<strong>OLED</strong>&nbsp;c&oacute; độ ph&acirc;n giải&nbsp;<strong>484 x 396 pixels</strong>, thiết bị cũng c&oacute; độ s&aacute;ng m&agrave;n h&igrave;nh đạt&nbsp;<strong>1.000 nits</strong>&nbsp;v&agrave; được bảo vệ bởi&nbsp;<strong>k&iacute;nh cường lực Ion-X</strong>&nbsp;nhằm gia tăng độ bền, mang đến khả năng hiển thị sắc n&eacute;t với độ s&aacute;ng cao gi&uacute;p người d&ugrave;ng dễ d&agrave;ng thao t&aacute;c v&agrave; xem nội dung ngay cả dưới &aacute;nh nắng gay gắt.</p>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-apple\" target=\"_blank\" title=\"Tham khảo đồng hồ thông minh Apple đang kinh doanh tại Thế Giới Di Động\">Đồng hồ th&ocirc;ng minh Apple</a>&nbsp;c&oacute; khung viền được ho&agrave;n thiện từ&nbsp;<strong>hợp kim nh&ocirc;m</strong>&nbsp;kết hợp c&ugrave;ng d&acirc;y đeo&nbsp;<strong>silicone</strong>&nbsp;mềm mại, th&acirc;n thiện với da tay, mang lại cảm gi&aacute;c thoải m&aacute;i cho cổ tay trong cả ng&agrave;y d&agrave;i hoạt động.</p>\n\n<p>&nbsp;',_binary '\0'),(99,'Đồng hồ thông minh Samsung Galaxy Watch5 44mm ',_binary 'data:image/jpeg;base64,','ON',15,'2023-10-24 18:00:00','2023-10-24 18:00:00','ADMIN','trieuldhph15903@fpt.edu.vn',_binary '\0',_binary '>Ng&agrave;y 10/8 vừa qua nh&agrave;&nbsp;<a href=\"https://www.thegioididong.com/dtdd-samsung\" target=\"_blank\" title=\"Điện thoại smartphone Samsung chính hãng, giá rẻ, trả góp 0%\" type=\"Điện thoại smartphone Samsung chính hãng, giá rẻ, trả góp 0%\">Samsung</a>&nbsp;đ&atilde; cho ra mắt phi&ecirc;n bản kế nhiệm của Galaxy Watch4 mang t&ecirc;n&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh/samsung-galaxy-watch5-44mm\" title=\"Đồng hồ thông minh Samsung Galaxy Watch5 44 mm tại thegioididong.com\">Samsung Galaxy Watch 5</a>. Mẫu smartwatch n&agrave;y thừa hưởng nhiều ưu điểm nổi bật của thế hệ trước đi c&ugrave;ng với nhiều cải tiến nổi bật, hứa hẹn sẽ được l&ograve;ng nhiều SamFans.</h3>\n\n<h3>Thiết kế vẫn mang n&eacute;t đẹp hiện đại c&ugrave;ng bảng m&agrave;u đẹp tuyệt</h3>\n\n<p>Samsung Galaxy Watch5 mang kiểu d&aacute;ng mặt tr&ograve;n quen thuộc m&agrave; ch&uacute;ng ta vẫn thường thấy ở những chiếc đồng hồ hồ th&ocirc;ng minh của h&atilde;ng. Phi&ecirc;n bản 44 mm mang đến một bảng m&agrave;u kh&aacute; nam t&iacute;nh nhưng vẫn gi&uacute;p cho người đeo to&aacute;t l&ecirc;n vẻ thời thượng, trẻ trung.</p>\n\n<p>Phần d&acirc;y đeo được ho&agrave;n thiện từ chất liệu&nbsp;<strong>silicone</strong>&nbsp;đi c&ugrave;ng với&nbsp;<strong>khung viền hợp kim nh&ocirc;m</strong>&nbsp;cao cấp v&agrave;&nbsp;<strong>mặt k&iacute;nh Sapphire</strong>. Đ&acirc;y ch&iacute;nh l&agrave; sự kết hợp h&agrave;i ho&agrave; giữa thẩm mỹ v&agrave; độ bền bỉ, gi&uacute;p cho đồng hồ lu&ocirc;n trong trạng th&aacute;i mới nhất cũng như hạn chế t&igrave;nh trạng trầy xước khi v&ocirc; t&igrave;nh bị va đập nhẹ.</p>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-samsung-mat-tron\" target=\"_blank\" title=\"Đồng hồ thông minh Samsung mặt tròn đang bán tại thegioididong.com\">Đồng hồ th&ocirc;ng minh Samsung mặt tr&ograve;n</a>&nbsp;sử dụng m&agrave;n h&igrave;nh&nbsp;<strong>1.4 inch</strong>&nbsp;c&oacute; độ ph&acirc;n giải&nbsp;<strong>450 x 450 pixels</strong>&nbsp;mang đến một kh&ocirc;ng gian hiển thị vừa đủ lớn v&agrave; c&oacute; thể nh&igrave;n r&otilde; ngay cả khi ở trong điều kiện &aacute;nh s&aacute;ng nắng gắt. Chưa hết, bạn sẽ tha hồ đa dạng h&oacute;a phong c&aacute;ch c&aacute; nh&acirc;n khi nh&agrave; Samsung ưu &aacute;i cung cấp cho bạn h&agrave;ng loạt giao diện mới.',_binary '\0'),(100,'Vòng đeo tay thông minh Mi Band 8 ',_binary 'data:image/jpeg;base64,','OFF',19,'2023-11-01 17:47:44','2023-11-01 17:47:44','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary '>Thương hiệu &ldquo;smartband quốc d&acirc;n&rdquo; vừa cho ra mắt thế hệ sản phẩm tiếp theo của m&igrave;nh mang t&ecirc;n&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh/mi-band-8\" target=\"_blank\" title=\"Vòng đeo tay thông minh Mi Band 8 đang bán tại thegioididong.com\">Mi Band 8</a>, với nhiều t&iacute;nh năng theo d&otilde;i sức khỏe, hỗ trợ luyện tập c&ugrave;ng v&ocirc; v&agrave;n tiện &iacute;ch hằng ng&agrave;y, đ&aacute;p ứng tốt mọi nhu cầu sử dụng cơ bản của người d&ugrave;ng.</h3>\n\n<h3>Thiết kế si&ecirc;u gọn nhẹ với viền m&agrave;n h&igrave;nh mỏng hơn</h3>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-xiaomi-mi-band\" target=\"_blank\" title=\"Xem thêm vòng đeo tay thông minh đang bán tại thegioididong.com\">V&ograve;ng đeo tay th&ocirc;ng minh Xiaomi</a>&nbsp;mang diện mạo h&igrave;nh con nhộng quen thuộc, thiết kế nhỏ gọn ph&ugrave; hợp với nhiều cỡ tay kh&aacute;c nhau. Sở hữu m&agrave;n h&igrave;nh&nbsp;<strong>1.62 inch AMOLED</strong>&nbsp;với độ ph&acirc;n giải cao&nbsp;<strong>490 x 192 pixels</strong>, v&ograve;ng tay th&ocirc;ng minh&nbsp;mang đến khả năng hiển thị xuất sắc.&nbsp;</p>\n\n<p>M&agrave;n h&igrave;nh cũng được n&acirc;ng cấp độ s&aacute;ng l&ecirc;n&nbsp;<strong>600 nits</strong>, cho ph&eacute;p xem nội dung r&otilde; r&agrave;ng trong nhiều điều kiện s&aacute;ng.&nbsp; Đồng thời, Mi Band 8 cũng hỗ trợ t&iacute;nh năng mới tự động điều chỉnh độ s&aacute;ng ph&ugrave; hợp với m&ocirc;i trường xung quanh, gi&uacute;p tiết kiệm năng lượng hơn.&nbsp;</p>\n\n<p>Ngo&agrave;i ra, v&ograve;ng tay c&ograve;n được trang bị t&iacute;nh năng&nbsp;<strong>Always on Display</strong>&nbsp;(M&agrave;n h&igrave;nh lu&ocirc;n bật), c&ugrave;ng&nbsp;<strong>hơn 100 giao diện</strong>&nbsp;t&ugrave;y biến đủ mọi phong c&aacute;ch, mang lại cảm hứng mới mẻ v&agrave; th&uacute; vị cho người d&ugrave;ng khi đeo.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-3.jpg\" onclick=\"return false;\"><img alt=\"Vòng đeo tay thông minh Mi Band 8 - Thiết kế\" src=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-3.jpg\" title=\"Vòng đeo tay thông minh Mi Band 8 - Thiết kế\" /></a></p>\n\n<p>Về d&acirc;y đeo, Xiaomi đ&atilde; chuyển thiết kế d&acirc;y quen thuộc sang sử dụng n&uacute;t bấm mở tiện dụng nhưng phần d&acirc;y được gh&eacute;p nối với thiết bị bằng chốt thay v&igrave; ng&agrave;m trượt. Kiểu d&acirc;y n&agrave;y ưu điểm l&agrave; dễ thay đổi, th&aacute;o lắp, nhưng nhược điểm l&agrave; phụ kiện tương th&iacute;ch c&ograve;n kh&aacute; &iacute;t tr&ecirc;n thị trường hiện tại.</p>\n\n<p>Chất liệu&nbsp;<strong>d&acirc;y TPU</strong>&nbsp;kh&aacute;ng khuẩn cũng mang lại sự thoải m&aacute;i, &ecirc;m nhẹ cho cổ tay người d&ugrave;ng trong mọi hoạt động từ luyện tập đến sinh hoạt thường nhật.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-2.jpg\" onclick=\"return false;\"><img alt=\"Vòng đeo tay thông minh Mi Band 8 - Màn hình\" src=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-2.jpg\" title=\"Vòng đeo tay thông minh Mi Band 8 - Màn hình\" /></a></p>\n\n<h3>Trợ l&yacute; sức khỏe nhỏ gọn ngay tr&ecirc;n cổ tay</h3>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh?g=vong-tay-thong-minh\" target=\"_blank\" title=\"Xem thêm vòng tay thông minh tại Thế Giới Di Động\">V&ograve;ng tay th&ocirc;ng minh</a>&nbsp;được t&iacute;ch hợp cảm biến theo d&otilde;i nhịp tim, lượng oxy trong m&aacute;u (<a href=\"https://www.thegioididong.com/dong-ho-thong-minh?g=do-nong-do-oxy-trong-mau-spo2\" target=\"_blank\" title=\"Xem thêm đồng hồ thông minh đo SpO2 đang bán tại thegioididong.com\">SpO2</a>) li&ecirc;n tục 24 giờ v&agrave; gửi cảnh b&aacute;o khi c&oacute; bất thường. B&ecirc;n cạnh đ&oacute; l&agrave; cảm biến&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-theo-doi-giac-ngu\" target=\"_blank\" title=\"Tham khảo thêm đồng hồ thông minh có chức năng theo dõi giấc ngủ tại Thế Giới Di Động\">theo d&otilde;i giấc ngủ</a>, c&oacute; khả năng cung cấp dữ liệu như chất lượng nhịp thở, giấc ngủ REM v&agrave; cả giấc ngủ ngắn buổi trưa.&nbsp;</p>\n\n<p>Ngo&agrave;i ra, smartband cũng sẽ theo d&otilde;i mức độ căng thẳng của bạn, đếm số bước đi, nhắc nhở vận động, theo d&otilde;i chu kỳ ph&aacute;i nữ,... gi&uacute;p bạn hiểu th&ecirc;m về sức khỏe bản th&acirc;n.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-4.jpg\" onclick=\"return false;\"><img alt=\"Vòng đeo tay thông minh Mi Band 8 - Tính năng sức khỏe\" src=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-4.jpg\" title=\"Vòng đeo tay thông minh Mi Band 8 - Tính năng sức khỏe\" /></a></p>\n\n<h3>Kh&ocirc;ng lo nh&agrave;m ch&aacute;n với v&ocirc; v&agrave;n chế độ luyện tập</h3>\n\n<p>Xiaomi Mi Band 8 được trang bị l&ecirc;n tới&nbsp;<strong>120</strong>&nbsp;chế độ thể thao,&nbsp;<strong>30</strong>&nbsp;chế độ tập thể dục v&agrave; c&oacute; thể&nbsp;<strong>tự động ph&aacute;t hiện</strong>&nbsp;một số chế độ phổ biến như: Chạy ngo&agrave;i trời, đi bộ, chạy tr&ecirc;n m&aacute;y, đạp xe ngo&agrave;i trời, ch&egrave;o thuyền v&agrave; tập luyện tr&ecirc;n m&aacute;y elip, gi&uacute;p bạn bước v&agrave;o b&agrave;i tập nhanh ch&oacute;ng m&agrave; kh&ocirc;ng cần phải c&agrave;i đặt trước.&nbsp;</p>\n\n<p>Sau khi ho&agrave;n th&agrave;nh một buổi tập luyện, Band 8 sẽ tổng hợp c&aacute;c kết quả quan trọng như lượng calo ti&ecirc;u thụ, nhịp tim,... cung cấp cho bạn một c&aacute;i nh&igrave;n tổng quan về hiệu quả của buổi tập v&agrave; c&aacute;ch cải thiện cho những buổi tập luyện tiếp theo.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-5.jpg\" onclick=\"return false;\"><img alt=\"Vòng đeo tay thông minh Mi Band 8 - Luyện tập\" src=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-5.jpg\" title=\"Vòng đeo tay thông minh Mi Band 8 - Luyện tập\" /></a></p>\n\n<h3>Kết nối, đồng bộ dữ liệu nhanh ch&oacute;ng qua Bluetooth&nbsp;</h3>\n\n<p>Xiaomi Mi Band 8 c&oacute; thể gh&eacute;p nối với c&aacute;c thiết bị chạy&nbsp;<strong>Android 6.0 trở l&ecirc;n</strong>&nbsp;hoặc&nbsp;<strong>iOS 10 trở l&ecirc;n</strong>&nbsp;nhờ&nbsp;<strong>Bluetooth v5.1&nbsp;</strong>th&ocirc;ng qua ứng dụng&nbsp;<a href=\"https://www.thegioididong.com/game-app/mi-fitness-ung-dung-ket-noi-voi-dong-ho-xiaomi-276983\" target=\"_blank\" title=\"Mi Fitness - Ứng dụng kết nối với đồng hồ Xiaomi\">Mi Fitness</a>, cho ph&eacute;p người d&ugrave;ng đồng bộ dữ liệu sức khỏe, luyện tập nhanh ch&oacute;ng giữa v&ograve;ng tay v&agrave; điện thoại.</p>\n\n<p>B&ecirc;n cạnh đ&oacute;, thiết bị cũng c&oacute; khả năng nhận tin nhắn, th&ocirc;ng b&aacute;o ứng dụng, cuộc gọi,... khi được kết nối với điện thoại, gi&uacute;p bạn kh&ocirc;ng bỏ lỡ bất kỳ th&ocirc;ng tin quan trọng n&agrave;o.</p>\n\n<p><strong>Tải ứng dụng Mi&nbsp;Fitness</strong><strong>:</strong>&nbsp;tr&ecirc;n&nbsp;<a href=\"https://play.google.com/store/apps/details?id=com.xiaomi.wearable&amp;hl=vi&amp;gl=US\" target=\"_blank\" title=\"Tải ứng dụng Mi Fitness trên CH Play\">CH Play</a>&nbsp;| tr&ecirc;n&nbsp;<a href=\"https://apps.apple.com/vn/app/xiaomi-wear-lite/id1493500777\" target=\"_blank\" title=\"Tải ứng dụng Mi Fitness trên App Store\">App Store</a></p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-7.jpg\" onclick=\"return false;\"><img alt=\"Vòng đeo tay thông minh Mi Band 8 - Bluetooth v5.1\" src=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-7.jpg\" title=\"Vòng đeo tay thông minh Mi Band 8 - Bluetooth v5.1\" /></a></p>\n\n<h3>Thời lượng pin d&agrave;i l&acirc;u, thoải m&aacute;i mang khi đi tắm, đi mưa</h3>\n\n<p>Xiaomi Mi Band 8 sở hữu vi&ecirc;n pin&nbsp;<strong>190 mAh</strong>, c&oacute; thời lượng sử dụng l&ecirc;n đến&nbsp;<strong>16 ng&agrave;y</strong>&nbsp;ở chế độ cơ bản, khoảng&nbsp;<strong>6 ng&agrave;y</strong>&nbsp;ở chế độ Always on Display (theo c&ocirc;ng bố từ h&atilde;ng). Thời lượng sử dụng thực tế sẽ c&oacute; ch&ecirc;nh lệch do cường độ sử dụng của mỗi người l&agrave; kh&aacute;c nhau.</p>\n\n<p>V&ograve;ng tay th&ocirc;ng minh nh&agrave; Xiaomi sử dụng&nbsp;<strong>d&acirc;y sạc nam ch&acirc;m</strong>&nbsp;tiện lợi, hỗ trợ sạc nhanh ch&oacute;ng chỉ trong khoảng&nbsp;<strong>1 giờ</strong>. Thiết kế n&agrave;y cũng tiện hơn so với thế hệ Mi Band 6 trở về trước khi người d&ugrave;ng kh&ocirc;ng phải th&aacute;o d&acirc;y để kết nối bộ sạc.</p>\n\n<p>Đạt chuẩn&nbsp;<strong>chống nước</strong>&nbsp;<strong>5 ATM - ISO 22810:2010</strong>, n&ecirc;n bạn ho&agrave;n to&agrave;n c&oacute; thể thoải m&aacute;i đeo khi rửa tay, đi tắm, hoạt động ở v&ugrave;ng nước n&ocirc;ng,... Tuy nhi&ecirc;n, bạn kh&ocirc;ng n&ecirc;n đeo thiết bị khi tắm nước n&oacute;ng, kh&ocirc;ng rửa với h&oacute;a chất,... để đảm bảo khả năng sử dụng được l&acirc;u d&agrave;i.</p>\n\n<p>&nbsp;</p>\n\n<h3>Th&ecirc;m nhiều tiện &iacute;ch chờ bạn trải nghiệm</h3>\n\n<p>Mi Band 8 cũng sở hữu nhiều tiện &iacute;ch của một chiếc&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh\" target=\"_blank\" title=\"Xem thêm đồng hồ thông minh đang bán tại thegioididong.com\">đồng hồ th&ocirc;ng minh</a>, sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng bạn trong mọi hoạt động hằng ng&agrave;y như b&aacute;o thức, thời tiết, n&acirc;ng cổ tay s&aacute;ng m&agrave;n h&igrave;nh, rung th&ocirc;ng b&aacute;o, từ chối cuộc gọi, nhắc nhở sự kiện,...</p>\n\n<p>Mang thiết kế gọn nhẹ, thoải m&aacute;i, đi k&egrave;m v&ocirc; v&agrave;n t&iacute;nh năng sức khỏe, t&iacute;ch hợp nhiều chế độ thể thao v&agrave; rất nhiều tiện &iacute;ch hằng ng&agrave;y, Mi Band 8 sẽ l&agrave; một trợ thủ đắc lực cho người d&ugrave;ng trong sinh hoạt, luyện tập với một mức gi&aacute; v&ocirc; c&ugrave;ng dễ chịu.',_binary '\0');
INSERT INTO `product` VALUES (101,'Vòng đeo tay thông minh Mi Band 8 ',_binary 'data:image/jpeg;base64,','ON',19,'2023-11-01 17:48:25','2023-11-01 17:48:25','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary '>Thương hiệu &ldquo;smartband quốc d&acirc;n&rdquo; vừa cho ra mắt thế hệ sản phẩm tiếp theo của m&igrave;nh mang t&ecirc;n&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh/mi-band-8\" target=\"_blank\" title=\"Vòng đeo tay thông minh Mi Band 8 đang bán tại thegioididong.com\">Mi Band 8</a>, với nhiều t&iacute;nh năng theo d&otilde;i sức khỏe, hỗ trợ luyện tập c&ugrave;ng v&ocirc; v&agrave;n tiện &iacute;ch hằng ng&agrave;y, đ&aacute;p ứng tốt mọi nhu cầu sử dụng cơ bản của người d&ugrave;ng.</h3>\n\n<h3>Thiết kế si&ecirc;u gọn nhẹ với viền m&agrave;n h&igrave;nh mỏng hơn</h3>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-xiaomi-mi-band\" target=\"_blank\" title=\"Xem thêm vòng đeo tay thông minh đang bán tại thegioididong.com\">V&ograve;ng đeo tay th&ocirc;ng minh Xiaomi</a>&nbsp;mang diện mạo h&igrave;nh con nhộng quen thuộc, thiết kế nhỏ gọn ph&ugrave; hợp với nhiều cỡ tay kh&aacute;c nhau. Sở hữu m&agrave;n h&igrave;nh&nbsp;<strong>1.62 inch AMOLED</strong>&nbsp;với độ ph&acirc;n giải cao&nbsp;<strong>490 x 192 pixels</strong>, v&ograve;ng tay th&ocirc;ng minh&nbsp;mang đến khả năng hiển thị xuất sắc.&nbsp;</p>\n\n<p>M&agrave;n h&igrave;nh cũng được n&acirc;ng cấp độ s&aacute;ng l&ecirc;n&nbsp;<strong>600 nits</strong>, cho ph&eacute;p xem nội dung r&otilde; r&agrave;ng trong nhiều điều kiện s&aacute;ng.&nbsp; Đồng thời, Mi Band 8 cũng hỗ trợ t&iacute;nh năng mới tự động điều chỉnh độ s&aacute;ng ph&ugrave; hợp với m&ocirc;i trường xung quanh, gi&uacute;p tiết kiệm năng lượng hơn.&nbsp;</p>\n\n<p>Ngo&agrave;i ra, v&ograve;ng tay c&ograve;n được trang bị t&iacute;nh năng&nbsp;<strong>Always on Display</strong>&nbsp;(M&agrave;n h&igrave;nh lu&ocirc;n bật), c&ugrave;ng&nbsp;<strong>hơn 100 giao diện</strong>&nbsp;t&ugrave;y biến đủ mọi phong c&aacute;ch, mang lại cảm hứng mới mẻ v&agrave; th&uacute; vị cho người d&ugrave;ng khi đeo.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-3.jpg\" onclick=\"return false;\"><img alt=\"Vòng đeo tay thông minh Mi Band 8 - Thiết kế\" src=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-3.jpg\" title=\"Vòng đeo tay thông minh Mi Band 8 - Thiết kế\" /></a></p>\n\n<p>Về d&acirc;y đeo, Xiaomi đ&atilde; chuyển thiết kế d&acirc;y quen thuộc sang sử dụng n&uacute;t bấm mở tiện dụng nhưng phần d&acirc;y được gh&eacute;p nối với thiết bị bằng chốt thay v&igrave; ng&agrave;m trượt. Kiểu d&acirc;y n&agrave;y ưu điểm l&agrave; dễ thay đổi, th&aacute;o lắp, nhưng nhược điểm l&agrave; phụ kiện tương th&iacute;ch c&ograve;n kh&aacute; &iacute;t tr&ecirc;n thị trường hiện tại.</p>\n\n<p>Chất liệu&nbsp;<strong>d&acirc;y TPU</strong>&nbsp;kh&aacute;ng khuẩn cũng mang lại sự thoải m&aacute;i, &ecirc;m nhẹ cho cổ tay người d&ugrave;ng trong mọi hoạt động từ luyện tập đến sinh hoạt thường nhật.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-2.jpg\" onclick=\"return false;\"><img alt=\"Vòng đeo tay thông minh Mi Band 8 - Màn hình\" src=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-2.jpg\" title=\"Vòng đeo tay thông minh Mi Band 8 - Màn hình\" /></a></p>\n\n<h3>Trợ l&yacute; sức khỏe nhỏ gọn ngay tr&ecirc;n cổ tay</h3>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh?g=vong-tay-thong-minh\" target=\"_blank\" title=\"Xem thêm vòng tay thông minh tại Thế Giới Di Động\">V&ograve;ng tay th&ocirc;ng minh</a>&nbsp;được t&iacute;ch hợp cảm biến theo d&otilde;i nhịp tim, lượng oxy trong m&aacute;u (<a href=\"https://www.thegioididong.com/dong-ho-thong-minh?g=do-nong-do-oxy-trong-mau-spo2\" target=\"_blank\" title=\"Xem thêm đồng hồ thông minh đo SpO2 đang bán tại thegioididong.com\">SpO2</a>) li&ecirc;n tục 24 giờ v&agrave; gửi cảnh b&aacute;o khi c&oacute; bất thường. B&ecirc;n cạnh đ&oacute; l&agrave; cảm biến&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-theo-doi-giac-ngu\" target=\"_blank\" title=\"Tham khảo thêm đồng hồ thông minh có chức năng theo dõi giấc ngủ tại Thế Giới Di Động\">theo d&otilde;i giấc ngủ</a>, c&oacute; khả năng cung cấp dữ liệu như chất lượng nhịp thở, giấc ngủ REM v&agrave; cả giấc ngủ ngắn buổi trưa.&nbsp;</p>\n\n<p>Ngo&agrave;i ra, smartband cũng sẽ theo d&otilde;i mức độ căng thẳng của bạn, đếm số bước đi, nhắc nhở vận động, theo d&otilde;i chu kỳ ph&aacute;i nữ,... gi&uacute;p bạn hiểu th&ecirc;m về sức khỏe bản th&acirc;n.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-4.jpg\" onclick=\"return false;\"><img alt=\"Vòng đeo tay thông minh Mi Band 8 - Tính năng sức khỏe\" src=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-4.jpg\" title=\"Vòng đeo tay thông minh Mi Band 8 - Tính năng sức khỏe\" /></a></p>\n\n<h3>Kh&ocirc;ng lo nh&agrave;m ch&aacute;n với v&ocirc; v&agrave;n chế độ luyện tập</h3>\n\n<p>Xiaomi Mi Band 8 được trang bị l&ecirc;n tới&nbsp;<strong>120</strong>&nbsp;chế độ thể thao,&nbsp;<strong>30</strong>&nbsp;chế độ tập thể dục v&agrave; c&oacute; thể&nbsp;<strong>tự động ph&aacute;t hiện</strong>&nbsp;một số chế độ phổ biến như: Chạy ngo&agrave;i trời, đi bộ, chạy tr&ecirc;n m&aacute;y, đạp xe ngo&agrave;i trời, ch&egrave;o thuyền v&agrave; tập luyện tr&ecirc;n m&aacute;y elip, gi&uacute;p bạn bước v&agrave;o b&agrave;i tập nhanh ch&oacute;ng m&agrave; kh&ocirc;ng cần phải c&agrave;i đặt trước.&nbsp;</p>\n\n<p>Sau khi ho&agrave;n th&agrave;nh một buổi tập luyện, Band 8 sẽ tổng hợp c&aacute;c kết quả quan trọng như lượng calo ti&ecirc;u thụ, nhịp tim,... cung cấp cho bạn một c&aacute;i nh&igrave;n tổng quan về hiệu quả của buổi tập v&agrave; c&aacute;ch cải thiện cho những buổi tập luyện tiếp theo.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-5.jpg\" onclick=\"return false;\"><img alt=\"Vòng đeo tay thông minh Mi Band 8 - Luyện tập\" src=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-5.jpg\" title=\"Vòng đeo tay thông minh Mi Band 8 - Luyện tập\" /></a></p>\n\n<h3>Kết nối, đồng bộ dữ liệu nhanh ch&oacute;ng qua Bluetooth&nbsp;</h3>\n\n<p>Xiaomi Mi Band 8 c&oacute; thể gh&eacute;p nối với c&aacute;c thiết bị chạy&nbsp;<strong>Android 6.0 trở l&ecirc;n</strong>&nbsp;hoặc&nbsp;<strong>iOS 10 trở l&ecirc;n</strong>&nbsp;nhờ&nbsp;<strong>Bluetooth v5.1&nbsp;</strong>th&ocirc;ng qua ứng dụng&nbsp;<a href=\"https://www.thegioididong.com/game-app/mi-fitness-ung-dung-ket-noi-voi-dong-ho-xiaomi-276983\" target=\"_blank\" title=\"Mi Fitness - Ứng dụng kết nối với đồng hồ Xiaomi\">Mi Fitness</a>, cho ph&eacute;p người d&ugrave;ng đồng bộ dữ liệu sức khỏe, luyện tập nhanh ch&oacute;ng giữa v&ograve;ng tay v&agrave; điện thoại.</p>\n\n<p>B&ecirc;n cạnh đ&oacute;, thiết bị cũng c&oacute; khả năng nhận tin nhắn, th&ocirc;ng b&aacute;o ứng dụng, cuộc gọi,... khi được kết nối với điện thoại, gi&uacute;p bạn kh&ocirc;ng bỏ lỡ bất kỳ th&ocirc;ng tin quan trọng n&agrave;o.</p>\n\n<p><strong>Tải ứng dụng Mi&nbsp;Fitness</strong><strong>:</strong>&nbsp;tr&ecirc;n&nbsp;<a href=\"https://play.google.com/store/apps/details?id=com.xiaomi.wearable&amp;hl=vi&amp;gl=US\" target=\"_blank\" title=\"Tải ứng dụng Mi Fitness trên CH Play\">CH Play</a>&nbsp;| tr&ecirc;n&nbsp;<a href=\"https://apps.apple.com/vn/app/xiaomi-wear-lite/id1493500777\" target=\"_blank\" title=\"Tải ứng dụng Mi Fitness trên App Store\">App Store</a></p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-7.jpg\" onclick=\"return false;\"><img alt=\"Vòng đeo tay thông minh Mi Band 8 - Bluetooth v5.1\" src=\"https://cdn.tgdd.vn/Products/Images/7077/315755/mi-band-8-sld-7.jpg\" title=\"Vòng đeo tay thông minh Mi Band 8 - Bluetooth v5.1\" /></a></p>\n\n<h3>Thời lượng pin d&agrave;i l&acirc;u, thoải m&aacute;i mang khi đi tắm, đi mưa</h3>\n\n<p>Xiaomi Mi Band 8 sở hữu vi&ecirc;n pin&nbsp;<strong>190 mAh</strong>, c&oacute; thời lượng sử dụng l&ecirc;n đến&nbsp;<strong>16 ng&agrave;y</strong>&nbsp;ở chế độ cơ bản, khoảng&nbsp;<strong>6 ng&agrave;y</strong>&nbsp;ở chế độ Always on Display (theo c&ocirc;ng bố từ h&atilde;ng). Thời lượng sử dụng thực tế sẽ c&oacute; ch&ecirc;nh lệch do cường độ sử dụng của mỗi người l&agrave; kh&aacute;c nhau.</p>\n\n<p>V&ograve;ng tay th&ocirc;ng minh nh&agrave; Xiaomi sử dụng&nbsp;<strong>d&acirc;y sạc nam ch&acirc;m</strong>&nbsp;tiện lợi, hỗ trợ sạc nhanh ch&oacute;ng chỉ trong khoảng&nbsp;<strong>1 giờ</strong>. Thiết kế n&agrave;y cũng tiện hơn so với thế hệ Mi Band 6 trở về trước khi người d&ugrave;ng kh&ocirc;ng phải th&aacute;o d&acirc;y để kết nối bộ sạc.</p>\n\n<p>Đạt chuẩn&nbsp;<strong>chống nước</strong>&nbsp;<strong>5 ATM - ISO 22810:2010</strong>, n&ecirc;n bạn ho&agrave;n to&agrave;n c&oacute; thể thoải m&aacute;i đeo khi rửa tay, đi tắm, hoạt động ở v&ugrave;ng nước n&ocirc;ng,... Tuy nhi&ecirc;n, bạn kh&ocirc;ng n&ecirc;n đeo thiết bị khi tắm nước n&oacute;ng, kh&ocirc;ng rửa với h&oacute;a chất,... để đảm bảo khả năng sử dụng được l&acirc;u d&agrave;i.</p>\n\n<p>&nbsp;</p>\n\n<h3>Th&ecirc;m nhiều tiện &iacute;ch chờ bạn trải nghiệm</h3>\n\n<p>Mi Band 8 cũng sở hữu nhiều tiện &iacute;ch của một chiếc&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh\" target=\"_blank\" title=\"Xem thêm đồng hồ thông minh đang bán tại thegioididong.com\">đồng hồ th&ocirc;ng minh</a>, sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng bạn trong mọi hoạt động hằng ng&agrave;y như b&aacute;o thức, thời tiết, n&acirc;ng cổ tay s&aacute;ng m&agrave;n h&igrave;nh, rung th&ocirc;ng b&aacute;o, từ chối cuộc gọi, nhắc nhở sự kiện,...</p>\n\n<p>Mang thiết kế gọn nhẹ, thoải m&aacute;i, đi k&egrave;m v&ocirc; v&agrave;n t&iacute;nh năng sức khỏe, t&iacute;ch hợp nhiều chế độ thể thao v&agrave; rất nhiều tiện &iacute;ch hằng ng&agrave;y, Mi Band 8 sẽ l&agrave; một trợ thủ đắc lực cho người d&ugrave;ng trong sinh hoạt, luyện tập với một mức gi&aacute; v&ocirc; c&ugrave;ng dễ chịu.',_binary '\0'),(102,'Đồng hồ thông minh Xiaomi Redmi Watch',_binary 'data:image/jpeg;base64,','ON',19,'2023-11-01 17:53:27','2023-11-01 18:11:32','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary '>Tầm gi&aacute; chưa đến 3 triệu đồng th&igrave; một chiếc smartwatch vừa c&oacute; nghe gọi vừa được trang bị GPS độc lập kh&aacute; hiếm thấy nhưng gần đ&acirc;y Xiaomi đ&atilde; cho ra mắt sản phẩm đồng hồ th&ocirc;ng minh&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh/redmi-watch-3\" target=\"_blank\" title=\"Xem thêm Xiaomi Redmi Watch 3 tại Thế Giới Di Động\">Xiaomi Redmi Watch 3</a>&nbsp;c&oacute; cả hai t&iacute;nh năng tr&ecirc;n. B&ecirc;n cạnh đ&oacute; c&ograve;n được trang bị nhiều t&iacute;nh năng hỗ trợ theo d&otilde;i sức khỏe v&agrave; luyện tập phục vụ cho người d&ugrave;ng.</h3>\n\n<h3>Ngoại h&igrave;nh tương đồng với c&aacute;c thế hệ trước</h3>\n\n<p>X&eacute;t về vẻ bề ngo&agrave;i th&igrave; Xiaomi Redmi Watch 3 kh&ocirc;ng c&oacute; nhiều điểm kh&aacute;c biệt so với&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh/redmi-watch-2-lite\" target=\"_blank\" title=\"Đồng thông minh Xiaomi Redmi Watch 2 Lite 41.2mm đang kinh doanh tại Thế Giới Di Động\">Xiaomi Redmi Watch 2 Lite</a>&nbsp;đ&atilde; ra mắt trước đ&oacute;. Với mặt đồng hồ c&oacute; k&iacute;ch thước&nbsp;<strong>42.6 mm</strong>&nbsp;được bo cong 4 g&oacute;c thao cảm gi&aacute;c thanh tho&aacute;t khi đeo tr&ecirc;n tay. Theo cảm quan của m&igrave;nh th&igrave; cạnh dưới của mặt đồng hồ hơi d&agrave;y hơn 3 cạnh c&ograve;n lại nh&igrave;n kh&ocirc;ng được c&acirc;n đối cho lắm.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-100-3.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Thiết kế\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-100-3.jpg\" title=\"Xiaomi Redmi Watch 3 - Thiết kế\" /></a></p>\n\n<p>L&uacute;c đeo chiếc đồng hồ n&agrave;y l&ecirc;n tay th&igrave; m&igrave;nh kh&ocirc;ng hề thấy nặng bởi&nbsp;khối lượng<strong>&nbsp;chỉ 37 g</strong>. Sử dụng&nbsp;<strong>d&acirc;y silicone&nbsp;</strong>c&oacute; bề mặt mềm mịn, tạo sự thoải m&aacute;i khi đeo tr&ecirc;n tay, chất liệu n&agrave;y chống thấm nước kh&aacute; tốt giữ sự kh&ocirc; tho&aacute;ng cả khi m&igrave;nh vận động chảy nhiều mồ h&ocirc;i.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-101-4.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Khối lượng\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-101-4.jpg\" title=\"Xiaomi Redmi Watch 3 - Khối lượng\" /></a></p>\n\n<p>Thay v&igrave; d&ugrave;ng loại kh&oacute;a kim g&agrave;i truyền thống th&igrave;&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-xiaomi\" target=\"_blank\" title=\"Xem thêm các sản phẩm đồng hồ thông minh Xiaomi tại Thế Giới Di Động\">đồng hồ th&ocirc;ng minh Xiaomi</a>&nbsp;đ&atilde; được trang bị kiểu kh&oacute;a đinh v&ocirc; c&ugrave;ng thẩm mỹ v&agrave; chắc chắn. Lần đầu sử dụng kiểu kh&oacute;a n&agrave;y m&igrave;nh đ&atilde; mất một l&uacute;c l&acirc;u để c&oacute; thể cố định đồng hồ, nhưng sau v&agrave;i lần th&igrave; thực hiện rất nhanh. D&acirc;y đồng hồ rất &ocirc;m tay, kh&ocirc;ng bị x&ecirc; dịch cả khi m&igrave;nh luyện tập.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-102-4.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Khóa cài chắc chắn\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-102-4.jpg\" title=\"Xiaomi Redmi Watch 3 - Khóa cài chắc chắn\" /></a></p>\n\n<p>Cạnh b&ecirc;n của mặt đồng hồ được trang bị&nbsp;<strong>một n&uacute;t điều khiển</strong>&nbsp;với cảm gi&aacute;c bấm &ecirc;m nhẹ. Nằm lệch ra ph&iacute;a sau của n&uacute;t bấm l&agrave; loa v&agrave; micro hỗ trợ cho việc đ&agrave;m thoại trực tiếp ngay tr&ecirc;n đồng hồ. Lật ra mặt sau l&agrave; hệ thống cảm biến tuy hơi nh&ocirc; ra nhưng sẽ kh&ocirc;ng bị cấn, để lại vết hằn nếu điều chỉnh d&acirc;y đeo vừa vặn với cổ tay.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-103-2.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Nút bấm\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-103-2.jpg\" title=\"Xiaomi Redmi Watch 3 - Nút bấm\" /></a></p>\n\n<h3>M&agrave;n h&igrave;nh lớn, khả năng hiển thị tốt ở nhiều điều kiện &aacute;nh s&aacute;ng</h3>\n\n<p>Với&nbsp;<strong>m&agrave;n h&igrave;nh 1.75 inch</strong>&nbsp;th&igrave; đồng hồ th&ocirc;ng minh Xiaomi Redmi Watch 3 đ&atilde; mang đến một kh&ocirc;ng gian hiển thị v&ocirc; c&ugrave;ng rộng r&atilde;i, m&igrave;nh thực hiện thao t&aacute;c vuốt chạm tr&ecirc;n m&agrave;n h&igrave;nh rất thoải m&aacute;i kh&ocirc;ng lo bị nhầm. M&agrave;n h&igrave;nh c&oacute; độ nhạy ở mức ổn, đ&ocirc;i khi thực hiện nhanh c&aacute;c thao t&aacute;c th&igrave; sẽ c&oacute; t&igrave;nh trạng phản hồi trễ nhưng kh&ocirc;ng đ&aacute;ng kể.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-104-2.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Màn hình sắc nét\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-104-2.jpg\" title=\"Xiaomi Redmi Watch 3 - Màn hình sắc nét\" /></a></p>\n\n<p>Một điểm cộng cho chiếc đồng hồ n&agrave;y l&agrave; được trang bị m&agrave;n h&igrave;nh&nbsp;<strong>AMOLED</strong>&nbsp;c&oacute; độ s&aacute;ng cao, m&agrave;u sắc sống động. M&agrave;n h&igrave;nh c&oacute; độ ph&acirc;n giải&nbsp;<strong>390 &times; 450 pixels</strong>&nbsp;cung cấp những nội dung r&otilde; n&eacute;t, những l&uacute;c m&igrave;nh d&ugrave;ng đồng hồ ở ngo&agrave;i trời tuy c&oacute; xuất hiện b&oacute;ng gương nhưng c&aacute;c th&ocirc;ng tin vẫn được hiển thị chi tiết.&nbsp;</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-105-2.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Rõ ràng trong nhiều môi trường sáng\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-105-2.jpg\" title=\"Xiaomi Redmi Watch 3 - Rõ ràng trong nhiều môi trường sáng\" /></a></p>\n\n<p>Tr&ecirc;n chiếc đồng hồ th&ocirc;ng minh Xiaomi n&agrave;y c&ograve;n được trang bị&nbsp;<strong>3 chế độ hiển thị th&ocirc;ng minh</strong>&nbsp;gồm: N&acirc;ng cổ tay s&aacute;ng m&agrave;n h&igrave;nh, chạm để đ&aacute;nh thức m&agrave;n h&igrave;nh v&agrave; m&agrave;n h&igrave;nh lu&ocirc;n hiển thị, thuận tiện hơn cho việc xem giờ hoặc v&agrave;i th&ocirc;ng tin cơ bản kh&aacute;c.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-106-1.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Các chế độ màn hình\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-106-1.jpg\" title=\"Xiaomi Redmi Watch 3 - Các chế độ màn hình\" /></a></p>\n\n<h3>Đa dạng chức năng theo d&otilde;i sức khỏe</h3>\n\n<p>Đồng hồ th&ocirc;ng minh được trang bị cảm biến sức khỏe hiện đại c&ugrave;ng thuật to&aacute;n th&ocirc;ng minh gi&uacute;p theo d&otilde;i nhịp tim, đo nồng độ oxy trong m&aacute;u (<a href=\"https://www.thegioididong.com/dong-ho-thong-minh?g=do-nong-do-oxy-trong-mau-spo2\" target=\"_blank\" title=\"Xem thêm các mẫu đồng hồ thông minh sở hữu tính năng đo nồng độ oxy trong máu hiện đang bán tại thegioididong.com\">SpO2</a>),&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-theo-doi-giac-ngu\" target=\"_blank\" title=\"Xem thêm các mẫu đồng hồ thông minh sở hữu tính năng theo dõi giấc ngủ hiện đang bán tại thegioididong.com\">theo d&otilde;i giấc ngủ</a>, mức độ stress,... hỗ trợ chăm s&oacute;c sức khỏe tốt hơn. Những l&uacute;c ph&aacute;t hiện nhịp tim qu&aacute; cao hoặc qu&aacute; thấp th&igrave; đồng hồ sẽ gửi cảnh b&aacute;o để người d&ugrave;ng điều chỉnh lại hoạt động cho ph&ugrave; hợp.</p>\n\n<p><strong>Lưu &yacute;:&nbsp;</strong>Đ&acirc;y kh&ocirc;ng phải l&agrave; thiết bị y tế, kh&ocirc;ng d&ugrave;ng để chẩn đo&aacute;n bệnh.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-107.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Các chức năng sức khỏe\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-107.jpg\" title=\"Xiaomi Redmi Watch 3 - Các chức năng sức khỏe\" /></a></p>\n\n<p>Khi m&igrave;nh sử dụng chức năng&nbsp;<strong>theo d&otilde;i sức khỏe&nbsp;</strong>th&igrave; thấy Redmi Watch 3 cung cấp số liệu giấc ngủ c&oacute; độ ch&iacute;nh x&aacute;c cao. Giờ ngủ v&agrave; thức dậy của m&igrave;nh được đồng hồ ghi lại đầy đủ v&agrave; gần như kh&ocirc;ng c&oacute; sự ch&ecirc;nh lệch so với thực tế, n&ecirc;n những ai cần cải thiện giấc ngủ th&igrave; c&oacute; thể tham khảo t&iacute;nh năng n&agrave;y.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-108.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Theo dõi giấc ngủ\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-108.jpg\" title=\"Xiaomi Redmi Watch 3 - Theo dõi giấc ngủ\" /></a></p>\n\n<p>B&ecirc;n cạnh đ&oacute;, m&igrave;nh c&ograve;n sử dụng chức năng&nbsp;<strong>đo SpO2</strong>&nbsp;v&agrave;&nbsp;<strong>nhịp tim</strong>&nbsp;bằng đồng hồ v&agrave; so với m&aacute;y đo y tế cầm tay th&igrave; thấy kết quả kh&ocirc;ng c&oacute; sự ch&ecirc;nh lệch qu&aacute; lớn, chỉ nằm trong khoảng 1 - 3 số. Tầm v&agrave;i ng&agrave;y m&igrave;nh sẽ sử dụng t&iacute;nh năng n&agrave;y một lần nhằm nắm bắt nhanh ch&oacute;ng sự thay đổi của cơ thể.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-109.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Đo nhịp tim và SpO2\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-109.jpg\" title=\"Xiaomi Redmi Watch 3 - Đo nhịp tim và SpO2\" /></a></p>\n\n<h3>Trợ l&yacute; thể thao chuy&ecirc;n nghiệp tr&ecirc;n cổ tay</h3>\n\n<p>Đồng hồ được trang bị&nbsp;<strong>hơn 121 chế độ thể thao</strong>&nbsp;từ c&aacute;c m&ocirc;n trong nh&agrave; cho đến ngo&agrave;i trời như:&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-dap-xe\" target=\"_blank\" title=\"Xem thêm sản phẩm smartwatch có chế độ đạp xe tại Thế Giới Di Động\">Đạp xe</a>, leo n&uacute;i, chạy bộ, nhảy d&acirc;y,&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-boi-loi\" target=\"_blank\" title=\"Xem thêm sản phẩm smartwatch có chế độ bơi lội tại Thế Giới Di Động\">bơi lội</a>, trượt tuyết,... đ&aacute;p ứng đa dạng nhu cầu của người d&ugrave;ng. Trong qu&aacute; tr&igrave;nh luyện tập đồng hồ sẽ theo d&otilde;i nhịp tim, t&iacute;nh lượng calo ti&ecirc;u thụ, thời gian tập luyện,... hỗ trợ m&igrave;nh đ&aacute;nh gi&aacute; hiệu quả luyện tập ch&iacute;nh x&aacute;c hơn. Đồng thời, thiết bị c&ograve;n c&oacute; khả năng nhận dạng 6 chế độ thể thao v&ocirc; c&ugrave;ng tiện lợi.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-110.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Các chế độ luyện tập\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-110.jpg\" title=\"Xiaomi Redmi Watch 3 - Các chế độ luyện tập\" /></a></p>\n\n<p>B&ecirc;n cạnh đ&oacute;, đồng hồ th&ocirc;ng minh c&ograve;n được trang bị&nbsp;<strong>GPS độc lập</strong>&nbsp;với hệ thống định vị 5 vệ tinh gồm:&nbsp;<strong>BDS</strong>,&nbsp;<strong>GPS</strong>,&nbsp;<strong>GLONASS</strong>,<strong>&nbsp;Galileo&nbsp;</strong>v&agrave;&nbsp;<strong>QZSS</strong>&nbsp;gi&uacute;p theo d&otilde;i vị tr&iacute; người d&ugrave;ng với độ ch&iacute;nh x&aacute;c cao, hỗ trợ theo d&otilde;i lộ tr&igrave;nh khi tập luyện ngo&agrave;i trời.</p>\n\n<p>&nbsp;</p>\n\n<p>M&igrave;nh đ&atilde; bật chế độ đạp xe ngo&agrave;i trời tr&ecirc;n đồng hồ v&agrave; so s&aacute;nh với kết quả tr&ecirc;n đồng hồ xe m&aacute;y, sau khoảng 20 ph&uacute;t th&igrave; Redmi Watch 3 đo qu&atilde;ng đường đi được l&agrave;&nbsp;<strong>9.27 km&nbsp;</strong>c&ograve;n xe m&aacute;y ghi được&nbsp;<strong>9.4 km</strong>. Nh&igrave;n chung kh&ocirc;ng c&oacute; ch&ecirc;nh lệch qu&aacute; lớn d&ugrave; m&igrave;nh tập luyện ở khu vực đ&ocirc; thị đ&ocirc;ng đ&uacute;c, nơi t&iacute;n hiệu GPS cũng kh&ocirc;ng được ổn định.</p>\n\n<p>&nbsp;</p>\n\n<h3>Thời lượng pin sử dụng thực tế</h3>\n\n<p>Theo th&ocirc;ng tin m&agrave; h&atilde;ng cung cấp th&igrave; Redmi Watch 3 được trang bị&nbsp;<strong>vi&ecirc;n pin 289 mAh&nbsp;</strong>cho thời gian sử dụng l&ecirc;n đến&nbsp;<strong>12 ng&agrave;y</strong>&nbsp;ở chế độ cơ bản. M&igrave;nh đ&atilde; sử dụng đồng hồ với m&agrave;n h&igrave;nh độ s&aacute;ng, bật&nbsp;<strong>Always On Display</strong>, bật nhận th&ocirc;ng b&aacute;o li&ecirc;n tục, nghe gọi, c&aacute;c chức năng sức khỏe m&igrave;nh đều d&ugrave;ng qua, c&ugrave;ng với c&aacute;c tiện &iacute;ch kh&aacute;c tr&ecirc;n đồng hồ.&nbsp;</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-113.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Thời lượng pin\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-113.jpg\" title=\"Xiaomi Redmi Watch 3 - Thời lượng pin\" /></a></p>\n\n<p>Sau 4 ng&agrave;y th&igrave; pin của thiết bị c&ograve;n<strong>&nbsp;khoảng 40%</strong>, theo m&igrave;nh nghĩ th&igrave; c&oacute; thể d&ugrave;ng tiếp khoảng 3 - 4 ng&agrave;y nữa. Đ&acirc;y được xem l&agrave; thời gian sử dụng kh&aacute; d&agrave;i, do cần phải trải nghiệm để đưa ra đ&aacute;nh gi&aacute; cho c&aacute;c bạn tham khảo n&ecirc;n m&igrave;nh sử dụng với cường độ cực kỳ cao, đối với người d&ugrave;ng phổ th&ocirc;ng th&igrave; dung lượng pin n&agrave;y c&oacute; thể k&eacute;o d&agrave;i hơn.</p>\n\n<p><strong>Lưu &yacute;:&nbsp;</strong>T&ugrave;y v&agrave;o cường độ sử dụng của người d&ugrave;ng m&agrave; thiết bị sẽ c&oacute; thời lượng pin thực tế kh&aacute;c nhau.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-114.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Thời lượng pin thực tế\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-114.jpg\" title=\"Xiaomi Redmi Watch 3 - Thời lượng pin thực tế\" /></a></p>\n\n<p>Đồng hồ c&oacute; chống nước 5 ATM - ISO 22810:2010 cho ph&eacute;p m&igrave;nh đeo khi đi mưa, rửa tay, bơi ở v&ugrave;ng nước n&ocirc;ng,... m&agrave; kh&ocirc;ng lo ngại nước x&acirc;m nhập v&agrave;o b&ecirc;n trong l&agrave;m hỏng thiết bị. Tuy nhi&ecirc;n, người d&ugrave;ng cần lưu &yacute; kh&ocirc;ng mang đồng hồ th&ocirc;ng minh v&agrave;o ph&ograve;ng x&ocirc;ng hơi, tiếp x&uacute;c với nước n&oacute;ng, h&oacute;a chất,... để đảm bảo khả năng kh&aacute;ng nước.</p>\n\n<p><strong>Lưu &yacute;:</strong>&nbsp;Chống nước tr&ecirc;n đồng hồ th&ocirc;ng minh kh&ocirc;ng phải vĩnh cửu m&agrave; sẽ bị suy yếu dần theo thời gian.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-484-1.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Chống nước\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-484-1.jpg\" title=\"Xiaomi Redmi Watch 3 - Chống nước\" /></a></p>\n\n<h3>Kết nối ổn định, nghe gọi ngay tr&ecirc;n đồng hồ</h3>\n\n<p>Ngo&agrave;i c&aacute;c t&iacute;nh năng luyện tập v&agrave; theo d&otilde;i sức khỏe th&igrave; Xiaomi Redmi Watch 3 c&ograve;n c&oacute; nghe gọi trực tiếp tr&ecirc;n đồng hồ, v&ocirc; c&ugrave;ng tiện lợi cho người d&ugrave;ng. Đồng hồ c&oacute; thể kết nối với cả iOS v&agrave; Android sau khi tải ứng dụng<strong>&nbsp;Mi Fitness</strong>&nbsp;tr&ecirc;n điện thoại.&nbsp;</p>\n\n<p><strong>Tải ứng dụng&nbsp;Mi Fitness:&nbsp;</strong><a href=\"https://play.google.com/store/apps/details?id=com.xiaomi.wearable&amp;hl=vi&amp;gl=US\" target=\"_blank\" title=\"Tải ứng dụng Mi Fitness trên CH Play\">CH Play</a>&nbsp;|&nbsp;<a href=\"https://apps.apple.com/vn/app/xiaomi-wear-lite/id1493500777\" target=\"_blank\" title=\"Tải ứng dụng Mi Fitness trên App Store\">App Store</a></p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-115.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Mi Fitness\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-115.jpg\" title=\"Xiaomi Redmi Watch 3 - Mi Fitness\" /></a></p>\n\n<p>Khi kết nối với điện thoại iOS th&igrave; đồng hồ c&oacute; thể nhận cuộc gọi quay số th&ocirc;ng thường hoặc cuộc gọi từ ứng dụng (Zalo, Messenger,...). C&ograve;n điện thoại Android chỉ nhận được cuộc gọi th&ocirc;ng thường, c&ograve;n cuộc gọi từ c&aacute;c ứng dụng đồng hồ chỉ hiển th&ocirc;ng b&aacute;o cuộc gọi nhỡ.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-116.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Tính năng cuộc gọi\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-116.jpg\" title=\"Xiaomi Redmi Watch 3 - Tính năng cuộc gọi\" /></a></p>\n\n<p>B&ecirc;n cạnh đ&oacute;, m&igrave;nh cũng c&oacute; thể th&ecirc;m số li&ecirc;n hệ trực tiếp tr&ecirc;n đồng hồ v&agrave; c&agrave;i đặt số điện thoại khẩn cấp để li&ecirc;n hệ nhanh khi cần thiết. Để thực hiện cuộc gọi khẩn cấp bạn chỉ cần bấm n&uacute;t ở cạnh b&ecirc;n 3 lần để gọi ngay đến số điện thoại đ&atilde; được thiết lập sẵn.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-117.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Cuộc gọi SOS\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-117.jpg\" title=\"Xiaomi Redmi Watch 3 - Cuộc gọi SOS\" /></a></p>\n\n<h3>Trang bị nhiều tiện &iacute;ch th&ocirc;ng minh</h3>\n\n<p>Xiaomi Redmi Watch 3 c&oacute;&nbsp;<strong>hơn 200 mặt đồng hồ&nbsp;</strong>người d&ugrave;ng c&oacute; thể thay đổi theo sở th&iacute;ch. Chế độ m&agrave;n h&igrave;nh lu&ocirc;n hiển thị gi&uacute;p bạn dễ d&agrave;ng xem giờ c&ugrave;ng một v&agrave;i chỉ số ngay cả khi đồng hồ đang ở chế độ chờ, tiện lợi hơn trong qu&aacute; tr&igrave;nh sử dụng.</p>\n\n<p>Ngo&agrave;i ra, đồng hồ th&ocirc;ng minh c&ograve;n được trang bị rất nhiều t&iacute;nh năng như: Điều khiển chơi nhạc, dự b&aacute;o thời tiết, t&igrave;m điện thoại, b&aacute;o thức,... hỗ trợ tốt hơn cho người d&ugrave;ng trong c&ocirc;ng việc lẫn cuộc sống.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-120.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 3 - Tiện ích\" src=\"https://cdn.tgdd.vn/Products/Images/7077/304166/redmi-watch-3-120.jpg\" title=\"Xiaomi Redmi Watch 3 - Tiện ích\" /></a></p>\n\n<p>Xiaomi Redmi Watch 3 c&oacute; nhiều n&acirc;ng cấp so với thế hệ trước, mang đến cho người d&ugrave;ng những trải nghiệm v&ocirc; c&ugrave;ng tuyệt vời. Những ai đang muốn trải nghiệm thiết bị c&ocirc;ng nghệ, quan t&acirc;m đến sức khỏe v&agrave; thường xuy&ecirc;n luyện tập thể thao th&igrave; c&oacute; thể c&acirc;n nhắc lựa chọn sản phẩm n&agrave;y.',_binary '\0'),(103,'Đồng hồ thông minh Xiaomi Redmi Watch 2 Lite',_binary 'data:image/jpeg;base64,','ON',19,'2023-11-01 17:55:06','2023-11-01 17:55:06','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary '>Ngay từ khi ra mắt&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh/redmi-watch-2-lite\" target=\"_blank\" title=\"Đồng thông minh Xiaomi Redmi Watch 2 Lite 41.2mm đang kinh doanh tại Thế Giới Di Động\">Xiaomi Redmi Watch 2 Lite&nbsp;</a>đ&atilde; thu h&uacute;t được rất nhiều sự ch&uacute; &yacute; của người d&ugrave;ng bởi mức gi&aacute; rẻ, thời lượng pin d&agrave;i, m&agrave;n h&igrave;nh lớn, GPS hiện đại c&ugrave;ng nhiều t&iacute;nh năng thể thao v&agrave; theo d&otilde;i sức khỏe đ&aacute;p ứng tốt nhu cầu của đại bộ phận người d&ugrave;ng phổ th&ocirc;ng.</h3>\n\n<h3>Phong c&aacute;ch tối giản, kiểu d&aacute;ng gọn g&agrave;ng</h3>\n\n<p>Xiaomi Redmi Watch 2 Lite c&oacute; khối lượng&nbsp;<strong>35 g</strong>, khi đeo tr&ecirc;n tay m&igrave;nh vận động v&ocirc; c&ugrave;ng thoải m&aacute;i, l&uacute;c chơi thể thao cũng kh&ocirc;ng cảm thấy vướng v&iacute;u. Mặt đồng c&oacute; k&iacute;ch thước&nbsp;<strong>41.2 mm</strong>&nbsp;ph&ugrave; hợp với cả nam lẫn nữ v&agrave; được phủ một lớp k&iacute;nh cường lực hạn chế nứt vỡ trong qu&aacute; tr&igrave;nh sử dụng.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-100.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Vẻ ngoài tối giản\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-100.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Vẻ ngoài tối giản\" /></a></p>\n\n<p>Khung viền được l&agrave;m từ hợp kim nh&ocirc;m c&oacute; khả năng chịu lực tương đối tốt, hạn chế t&igrave;nh trạng m&oacute;p m&eacute;o khi va đập. D&acirc;y&nbsp;<strong>TPU</strong>&nbsp;cho khả năng chống thấm nước tốt, theo cảm nhận của m&igrave;nh phần d&acirc;y đồng hồ kh&aacute; mềm kh&ocirc;ng bị cấn khi đeo, bề mặt nhẵn mịn nếu c&oacute; b&aacute;m bẩn th&igrave; cũng dễ l&agrave;m sạch.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-101.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Khung viền chắc chắn\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-101.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Khung viền chắc chắn\" /></a></p>\n\n<p>D&acirc;y c&oacute; thể th&aacute;o lắp th&ocirc;ng qua chốt g&agrave;i ở hai đầu, n&ecirc;n m&igrave;nh c&oacute; thể thay đổi d&acirc;y đeo theo sở th&iacute;ch chỉ cần lựa chọn k&iacute;ch thước cho ph&ugrave; hợp. Redmi Watch 2 Lite c&oacute; 3 phi&ecirc;n bản m&agrave;u gồm trắng, đen v&agrave; xanh dương v&ocirc; c&ugrave;ng thời trang v&agrave; ph&ugrave; hợp với đa số người d&ugrave;ng.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-102.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Dây tháo rời\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-102.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Dây tháo rời\" /></a></p>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-xiaomi\" target=\"_blank\" title=\"Xem thêm các sản phẩm đồng hồ thông minh Xiaomi tại Thế Giới Di Động\">Đồng hồ th&ocirc;ng minh Xiaomi</a>&nbsp;sở hữu m&agrave;n h&igrave;nh&nbsp;<strong>1.55 inch</strong>&nbsp;gi&uacute;p cho thao t&aacute;c vuốt chạm diễn ra mượt m&agrave; v&agrave; &iacute;t bị nhầm. C&ocirc;ng nghệ&nbsp;<a href=\"https://www.thegioididong.com/hoi-dap/man-hinh-tft-lcd-la-gi-co-uu-diem-gi-thiet-bi-nao-905743\" target=\"_blank\" title=\"Tìm hiểu thêm về màn hình TFT tại Thế Giới Di Động\">m&agrave;n h&igrave;nh TFT</a>&nbsp;tối ưu năng lượng, m&agrave;u sắc ch&acirc;n thật tuy nhi&ecirc;n l&uacute;c m&igrave;nh nh&igrave;n nghi&ecirc;ng th&igrave; m&agrave;u sắc của nội dung sẽ bị lệch hoặc nhạt hơn khi nh&igrave;n trực diện.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-104.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Màn hình\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-104.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Màn hình\" /></a></p>\n\n<h3>Tập luyện hiệu quả với nhiều chế độ thể thao v&agrave; GPS độc lập</h3>\n\n<p>Smartwatch được trang bị hơn<strong>&nbsp;100 chế độ luyện tập thể thao</strong>, người d&ugrave;ng c&oacute; thể th&ecirc;m hoặc bỏ c&aacute;c chế độ để c&aacute; nh&acirc;n h&oacute;a trong qu&aacute; tr&igrave;nh sử dụng. Đồng hồ c&oacute; thể theo d&otilde;i c&aacute;c hoạt động của người d&ugrave;ng như một chuy&ecirc;n gia với hơn&nbsp;<strong>17 chế độ luyện tập chuy&ecirc;n nghiệp</strong>&nbsp;gồm:&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-yoga\" target=\"_blank\" title=\"Xem thêm sản phẩm smartwatch có chế độ Yoga tại Thế Giới Di Động\">Yoga</a>, HIIT (Cardio cường độ cao),&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-boi-loi\" target=\"_blank\" title=\"Xem thêm sản phẩm smartwatch có chế độ bơi lội tại Thế Giới Di Động\">bơi lội</a>, nhảy d&acirc;y, m&aacute;y chạy bộ,&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-dap-xe\" target=\"_blank\" title=\"Xem thêm sản phẩm smartwatch có chế độ đạp xe tại Thế Giới Di Động\">đạp xe</a>,...&nbsp;</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-105.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Chế độ thể thao\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-105.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Chế độ thể thao\" /></a></p>\n\n<p>Tuy thuộc ph&acirc;n kh&uacute;c gi&aacute; rẻ nhưng Xiaomi Redmi Watch 2 Lite lại được trang bị&nbsp;<strong>GPS độc lập</strong>&nbsp;như những chiếc smartwatch cao cấp tr&ecirc;n thị trường. Đ&acirc;y được xem l&agrave; một ưu thế vượt trội của sản phẩm thu h&uacute;t được rất nhiều người d&ugrave;ng trong đ&oacute; c&oacute; cả m&igrave;nh.</p>\n\n<p>Với hệ thống định vị hiện đại gồm Galileo, Beidou,&nbsp;<a href=\"https://www.thegioididong.com/hoi-dap/he-thong-dinh-vi-gps-va-glonass-la-gi-729876\" target=\"_blank\" title=\"Tìm hiểu về Glonass tại Thế Giới Di Động\">GLONASS</a>&nbsp;v&agrave; GPS kết hợp c&ugrave;ng chipset GNSS gi&uacute;p việc theo d&otilde;i vị tr&iacute; của người d&ugrave;ng th&ecirc;m phần ch&iacute;nh x&aacute;c. Do l&agrave; GPS độc lập n&ecirc;n khi ngắt kết nối đồng hồ với điện thoại th&igrave; GPS vẫn hoạt động rất tốt.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-106.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - GPS độc lập\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-106.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - GPS độc lập\" /></a></p>\n\n<p>L&uacute;c tập luyện c&aacute;c m&ocirc;n ngo&agrave;i trời như đạp xe, chạy bộ hoặc đi bộ m&igrave;nh sẽ bật GPS tr&ecirc;n đồng hồ để đo lường kết quả của buổi tập một c&aacute;ch ch&iacute;nh x&aacute;c hơn. Đồng thời, m&igrave;nh cũng kh&ocirc;ng cần mang theo điện thoại b&ecirc;n m&igrave;nh để sử dụng GPS n&ecirc;n v&ocirc; c&ugrave;ng tiện lợi trong qu&aacute; tr&igrave;nh chơi thể thao.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-107.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Khả năng định vị vô cùng chính xác\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-107.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Khả năng định vị vô cùng chính xác\" /></a></p>\n\n<p>Để kiểm tra khả năng hoạt động của GPS, m&igrave;nh đ&atilde; bật chế độ đạp xe ngo&agrave;i trời v&agrave; đi từ Quận 6 đến T&acirc;n Ph&uacute;. Khi về đến nh&agrave;, m&igrave;nh xem dữ liệu m&agrave; đồng hồ đ&atilde; thu thập được th&igrave; kết quả chỉ c&oacute; sự ch&ecirc;nh lệch nhỏ, chứng tỏ hệ thống định vị hoạt động v&ocirc; c&ugrave;ng tốt.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-108.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Quãng đường đi được\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-108.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Quãng đường đi được\" /></a></p>\n\n<h3>Cập nhật t&igrave;nh trạng sức khỏe mọi l&uacute;c mọi nơi</h3>\n\n<p>B&ecirc;n cạnh c&aacute;c chế độ luyện tập, những chức năng theo d&otilde;i sức khỏe cũng rất đa dạng, đồng hồ c&oacute; thể đo nồng độ oxy trong m&aacute;u (<a href=\"https://www.thegioididong.com/dong-ho-thong-minh?g=do-nong-do-oxy-trong-mau-spo2\" target=\"_blank\" title=\"Xem thêm các mẫu đồng hồ thông minh sở hữu tính năng đo nồng độ oxy trong máu hiện đang bán tại thegioididong.com\">SpO2</a>), theo d&otilde;i nhịp tim 24h,&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-theo-doi-giac-ngu\" target=\"_blank\" title=\"Xem thêm các mẫu đồng hồ thông minh sở hữu tính năng theo dõi giấc ngủ hiện đang bán tại thegioididong.com\">theo d&otilde;i giấc ngủ</a>, theo d&otilde;i mức độ stress, chu kỳ kinh nguyệt,&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-do-nhip-tim\" title=\"Xem thêm các mẫu đồng hồ có chế độ theo dõi nhịp tim hiện đnag bán tại thegioididong.com\">đo nhịp tim</a>,... gi&uacute;p m&igrave;nh nắm bắt sự thay đổi của cơ thể một c&aacute;ch nhanh ch&oacute;ng.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-109.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Nhiều tính năng sức khỏe\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-109.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Nhiều tính năng sức khỏe\" /></a></p>\n\n<p>M&igrave;nh đ&atilde; tiến h&agrave;nh đo nhịp tim v&agrave; SpO2 tr&ecirc;n Redmi Watch 2 Lite sau đ&oacute; lấy kết quả so s&aacute;nh với m&aacute;y đo y tế để kiểm tra t&iacute;nh ch&iacute;nh x&aacute;c. Thực tế con số m&agrave; hai thiết bị cho ra cũng kh&ocirc;ng c&oacute; sự ch&ecirc;nh lệch qu&aacute; lớn, ho&agrave;n to&agrave;n c&oacute; thể tham khảo để chăm s&oacute;c sức khỏe một c&aacute;ch tốt hơn.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-110.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Đo SpO2 trên máy\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-110.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Đo SpO2 trên máy\" /></a></p>\n\n<p>M&igrave;nh cũng thường xuy&ecirc;n sử dụng chế độ theo d&otilde;i giấc ngủ để biết được số giờ ngủ, t&igrave;nh trạng ngủ, chất lượng giấc ngủ,... từ đ&oacute; đề xuất giấc ngủ ti&ecirc;u chuẩn để m&igrave;nh c&oacute; thể điều chỉnh cho ph&ugrave; hợp với nhu cầu của cơ thể.&nbsp;</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-111.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Theo dõi giấc ngủ\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-111.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Theo dõi giấc ngủ\" /></a></p>\n\n<h3>Khả năng kết nối ổn định</h3>\n\n<p>Xiaomi Redmi Watch 2 Lite được trang bị phương thức kết nối kh&ocirc;ng d&acirc;y Bluetooth v5.0 cho khả năng gh&eacute;p nối nhanh ch&oacute;ng với điện thoại sử dụng hệ điều h&agrave;nh Android 6.0 v&agrave; iOS 10 trở l&ecirc;n.&nbsp;</p>\n\n<p>Tải ứng dụng&nbsp;Mi Fitness: tr&ecirc;n&nbsp;<a href=\"https://play.google.com/store/apps/details?id=com.xiaomi.wearable&amp;hl=vi&amp;gl=US\" target=\"_blank\" title=\"Tải ứng dụng Mi Fitness trên CH Play\">CH Play</a>&nbsp;| tr&ecirc;n&nbsp;<a href=\"https://apps.apple.com/vn/app/xiaomi-wear-lite/id1493500777\" target=\"_blank\" title=\"Tải ứng dụng Mi Fitness trên App Store\">App Store</a></p>\n\n<p>Trước ti&ecirc;n m&igrave;nh cần phải tải Mi Fitness tr&ecirc;n điện thoại rồi tiến h&agrave;nh gh&eacute;p nối với Xiaomi Redmi Watch 2 Lite, nhập đầy đủ th&ocirc;ng tin cần thiết l&agrave; đ&atilde; sử dụng được. C&aacute;c thao t&aacute;c cũng kh&aacute; đơn giản, giao diện của ứng dụng được thiết kế gọn g&agrave;ng, những người lần đầu sử dụng thiết bị Xiaomi như m&igrave;nh cũng l&agrave;m quen rất nhanh.</p>\n\n<p>&nbsp;</p>\n\n<p>Đồng hồ c&oacute; thể nhận được tin nhắn, th&ocirc;ng b&aacute;o cuộc gọi đến v&agrave; th&ocirc;ng b&aacute;o từ c&aacute;c ứng dụng v&ocirc; c&ugrave;ng nhanh ch&oacute;ng gần như đồng thời với điện thoại. Theo cảm nhận của m&igrave;nh ph&ocirc;ng chữ của tin nhắn v&agrave; th&ocirc;ng b&aacute;o kh&aacute; r&otilde; r&agrave;ng, kh&ocirc;ng bị lỗi ph&ocirc;ng hay xuống d&ograve;ng đột ngột, rất dễ xem.</p>\n\n<p>&nbsp;</p>\n\n<p>Tuy kh&ocirc;ng thể trả lời tin nhắn v&agrave; cuộc gọi ngay tr&ecirc;n đồng hồ nhưng với mức gi&aacute; v&ocirc; c&ugrave;ng rẻ th&igrave; sản phẩm n&agrave;y đ&atilde; trang bị đầy đủ c&aacute;c t&iacute;nh năng cần thiết. Từ khi sử dụng smartwatch, t&igrave;nh trạng bỏ lỡ cuộc gọi hay tin nhắn của m&igrave;nh đ&atilde; được giảm đ&aacute;ng kể, đ&acirc;y l&agrave; một thiết bị hỗ trợ kh&aacute; tốt cho người cần kiểm tra điện thoại thường xuy&ecirc;n.</p>\n\n<p>&nbsp;</p>\n\n<h3>Thời lượng pin đủ d&ugrave;ng trong nhiều ng&agrave;y</h3>\n\n<p>Theo h&atilde;ng c&ocirc;ng bố, Xiaomi Redmi Watch 2 Lite được trang bị vi&ecirc;n pin c&oacute; dung lượng&nbsp;<strong>262 mAh&nbsp;</strong>c&oacute; thể hoạt động khoảng&nbsp;<strong>10 ng&agrave;y</strong>&nbsp;trong điều kiện ti&ecirc;u chuẩn,&nbsp;<strong>14 giờ</strong>&nbsp;nếu bật GPS li&ecirc;n tục khi chơi thể thao v&agrave;&nbsp;<strong>sạc đầy trong 3 giờ</strong>. Tuy nhi&ecirc;n thời gian sử dụng thực tế sẽ c&oacute; sự ch&ecirc;nh lệch t&ugrave;y v&agrave;o c&aacute;ch sử dụng của mỗi người d&ugrave;ng.</p>\n\n<p>&nbsp;</p>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh\" target=\"_blank\" title=\"Xem thêm các mẫu đồng hồ thông minh đang bán tại thegioididong.com\">Đồng hồ th&ocirc;ng minh</a>&nbsp;c&oacute; chuẩn&nbsp;<a href=\"https://www.thegioididong.com/hoi-dap/tim-hieu-chuan-khang-nuoc-5-atm-1053163#hmenuid2\" target=\"_blank\" title=\"Tìm hiểu chuẩn kháng nước 5 ATM tại Thế Giới Di Động\">kh&aacute;ng nước 5 ATM</a>&nbsp;n&ecirc;n m&igrave;nh rất y&ecirc;n t&acirc;m đeo khi rửa tay, tắm hoặc bơi ở v&ugrave;ng nước n&ocirc;ng. Tuy nhi&ecirc;n, theo m&igrave;nh để đảm bảo khả năng hoạt động v&agrave; sử dụng thiết bị d&agrave;i l&acirc;u bạn vẫn n&ecirc;n hạn chế để thiết bị tiếp x&uacute;c với nước, kh&ocirc;ng sử dụng thiết bị trong ph&ograve;ng tắm hơi, nguồn nước n&oacute;ng, đi lặn, d&ograve;ng nước mạnh,...</p>\n\n<p>&nbsp;</p>\n\n<h3>Đa dạng mặt đồng hồ v&agrave; tiện &iacute;ch th&ocirc;ng minh</h3>\n\n<p>Xiaomi Redmi Watch 2 Lite được trang bị hơn&nbsp;<strong>100 mặt đồng hồ</strong>&nbsp;để người d&ugrave;ng dễ d&agrave;ng thay đổi cho ph&ugrave; hợp với t&acirc;m trạng v&agrave; trang phục. Thao t&aacute;c đổi mặt đồng hồ cũng kh&aacute; đơn giản, bạn chỉ cần ấn giữ m&agrave;n h&igrave;nh trong v&agrave;i gi&acirc;y sau đ&oacute; lựa chọn giao diện hoặc bằng ứng dụng tr&ecirc;n điện thoại.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-118.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Nhiều mặt đồng hồ\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-118.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Nhiều mặt đồng hồ\" /></a></p>\n\n<p>Đồng hồ c&ograve;n c&oacute; nhiều t&iacute;nh năng v&ocirc; c&ugrave;ng tiện lợi cho người d&ugrave;ng tha hồ kh&aacute;m ph&aacute; như: điều khiển chơi nhạc, t&igrave;m điện thoại, dự b&aacute;o thời tiết, n&acirc;ng cổ tay s&aacute;ng m&agrave;n h&igrave;nh, bấm giờ,... gi&uacute;p n&acirc;ng cao chất lượng cuộc sống.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-119.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Nhiều tiện ích thông minh\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-119.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Nhiều tiện ích thông minh\" /></a></p>\n\n<p>Với mức gi&aacute; chưa đến 1.5 triệu đồng Xiaomi Redmi Watch 2 Lite vẫn được trang bị rất nhiều t&iacute;nh năng th&ocirc;ng minh, hệ thống định vị h&agrave;ng đầu, vi&ecirc;n pin lớn,... chắc chắn sẽ mang lại sự h&agrave;i l&ograve;ng cho những người y&ecirc;u th&iacute;ch luyện tập thể thao v&agrave; muốn theo d&otilde;i sức khỏe ngay tại nh&agrave;.&nbsp;',_binary '\0'),(104,'Đồng hồ thông minh Xiaomi Redmi Watch 2 Lite',_binary 'data:image/jpeg;base64,','ON',19,'2023-11-01 17:57:36','2023-11-01 18:11:11','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary '>Ngay từ khi ra mắt&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh/redmi-watch-2-lite\" target=\"_blank\" title=\"Đồng thông minh Xiaomi Redmi Watch 2 Lite 41.2mm đang kinh doanh tại Thế Giới Di Động\">Xiaomi Redmi Watch 2 Lite&nbsp;</a>đ&atilde; thu h&uacute;t được rất nhiều sự ch&uacute; &yacute; của người d&ugrave;ng bởi mức gi&aacute; rẻ, thời lượng pin d&agrave;i, m&agrave;n h&igrave;nh lớn, GPS hiện đại c&ugrave;ng nhiều t&iacute;nh năng thể thao v&agrave; theo d&otilde;i sức khỏe đ&aacute;p ứng tốt nhu cầu của đại bộ phận người d&ugrave;ng phổ th&ocirc;ng.</h3>\n\n<h3>Phong c&aacute;ch tối giản, kiểu d&aacute;ng gọn g&agrave;ng</h3>\n\n<p>Xiaomi Redmi Watch 2 Lite c&oacute; khối lượng&nbsp;<strong>35 g</strong>, khi đeo tr&ecirc;n tay m&igrave;nh vận động v&ocirc; c&ugrave;ng thoải m&aacute;i, l&uacute;c chơi thể thao cũng kh&ocirc;ng cảm thấy vướng v&iacute;u. Mặt đồng c&oacute; k&iacute;ch thước&nbsp;<strong>41.2 mm</strong>&nbsp;ph&ugrave; hợp với cả nam lẫn nữ v&agrave; được phủ một lớp k&iacute;nh cường lực hạn chế nứt vỡ trong qu&aacute; tr&igrave;nh sử dụng.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-100.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Vẻ ngoài tối giản\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-100.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Vẻ ngoài tối giản\" /></a></p>\n\n<p>Khung viền được l&agrave;m từ hợp kim nh&ocirc;m c&oacute; khả năng chịu lực tương đối tốt, hạn chế t&igrave;nh trạng m&oacute;p m&eacute;o khi va đập. D&acirc;y&nbsp;<strong>TPU</strong>&nbsp;cho khả năng chống thấm nước tốt, theo cảm nhận của m&igrave;nh phần d&acirc;y đồng hồ kh&aacute; mềm kh&ocirc;ng bị cấn khi đeo, bề mặt nhẵn mịn nếu c&oacute; b&aacute;m bẩn th&igrave; cũng dễ l&agrave;m sạch.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-101.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Khung viền chắc chắn\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-101.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Khung viền chắc chắn\" /></a></p>\n\n<p>D&acirc;y c&oacute; thể th&aacute;o lắp th&ocirc;ng qua chốt g&agrave;i ở hai đầu, n&ecirc;n m&igrave;nh c&oacute; thể thay đổi d&acirc;y đeo theo sở th&iacute;ch chỉ cần lựa chọn k&iacute;ch thước cho ph&ugrave; hợp. Redmi Watch 2 Lite c&oacute; 3 phi&ecirc;n bản m&agrave;u gồm trắng, đen v&agrave; xanh dương v&ocirc; c&ugrave;ng thời trang v&agrave; ph&ugrave; hợp với đa số người d&ugrave;ng.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-102.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Dây tháo rời\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-102.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Dây tháo rời\" /></a></p>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-xiaomi\" target=\"_blank\" title=\"Xem thêm các sản phẩm đồng hồ thông minh Xiaomi tại Thế Giới Di Động\">Đồng hồ th&ocirc;ng minh Xiaomi</a>&nbsp;sở hữu m&agrave;n h&igrave;nh&nbsp;<strong>1.55 inch</strong>&nbsp;gi&uacute;p cho thao t&aacute;c vuốt chạm diễn ra mượt m&agrave; v&agrave; &iacute;t bị nhầm. C&ocirc;ng nghệ&nbsp;<a href=\"https://www.thegioididong.com/hoi-dap/man-hinh-tft-lcd-la-gi-co-uu-diem-gi-thiet-bi-nao-905743\" target=\"_blank\" title=\"Tìm hiểu thêm về màn hình TFT tại Thế Giới Di Động\">m&agrave;n h&igrave;nh TFT</a>&nbsp;tối ưu năng lượng, m&agrave;u sắc ch&acirc;n thật tuy nhi&ecirc;n l&uacute;c m&igrave;nh nh&igrave;n nghi&ecirc;ng th&igrave; m&agrave;u sắc của nội dung sẽ bị lệch hoặc nhạt hơn khi nh&igrave;n trực diện.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-104.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Màn hình\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-104.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Màn hình\" /></a></p>\n\n<h3>Tập luyện hiệu quả với nhiều chế độ thể thao v&agrave; GPS độc lập</h3>\n\n<p>Smartwatch được trang bị hơn<strong>&nbsp;100 chế độ luyện tập thể thao</strong>, người d&ugrave;ng c&oacute; thể th&ecirc;m hoặc bỏ c&aacute;c chế độ để c&aacute; nh&acirc;n h&oacute;a trong qu&aacute; tr&igrave;nh sử dụng. Đồng hồ c&oacute; thể theo d&otilde;i c&aacute;c hoạt động của người d&ugrave;ng như một chuy&ecirc;n gia với hơn&nbsp;<strong>17 chế độ luyện tập chuy&ecirc;n nghiệp</strong>&nbsp;gồm:&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-yoga\" target=\"_blank\" title=\"Xem thêm sản phẩm smartwatch có chế độ Yoga tại Thế Giới Di Động\">Yoga</a>, HIIT (Cardio cường độ cao),&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-boi-loi\" target=\"_blank\" title=\"Xem thêm sản phẩm smartwatch có chế độ bơi lội tại Thế Giới Di Động\">bơi lội</a>, nhảy d&acirc;y, m&aacute;y chạy bộ,&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-dap-xe\" target=\"_blank\" title=\"Xem thêm sản phẩm smartwatch có chế độ đạp xe tại Thế Giới Di Động\">đạp xe</a>,...&nbsp;</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-105.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Chế độ thể thao\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-105.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Chế độ thể thao\" /></a></p>\n\n<p>Tuy thuộc ph&acirc;n kh&uacute;c gi&aacute; rẻ nhưng Xiaomi Redmi Watch 2 Lite lại được trang bị&nbsp;<strong>GPS độc lập</strong>&nbsp;như những chiếc smartwatch cao cấp tr&ecirc;n thị trường. Đ&acirc;y được xem l&agrave; một ưu thế vượt trội của sản phẩm thu h&uacute;t được rất nhiều người d&ugrave;ng trong đ&oacute; c&oacute; cả m&igrave;nh.</p>\n\n<p>Với hệ thống định vị hiện đại gồm Galileo, Beidou,&nbsp;<a href=\"https://www.thegioididong.com/hoi-dap/he-thong-dinh-vi-gps-va-glonass-la-gi-729876\" target=\"_blank\" title=\"Tìm hiểu về Glonass tại Thế Giới Di Động\">GLONASS</a>&nbsp;v&agrave; GPS kết hợp c&ugrave;ng chipset GNSS gi&uacute;p việc theo d&otilde;i vị tr&iacute; của người d&ugrave;ng th&ecirc;m phần ch&iacute;nh x&aacute;c. Do l&agrave; GPS độc lập n&ecirc;n khi ngắt kết nối đồng hồ với điện thoại th&igrave; GPS vẫn hoạt động rất tốt.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-106.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - GPS độc lập\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-106.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - GPS độc lập\" /></a></p>\n\n<p>L&uacute;c tập luyện c&aacute;c m&ocirc;n ngo&agrave;i trời như đạp xe, chạy bộ hoặc đi bộ m&igrave;nh sẽ bật GPS tr&ecirc;n đồng hồ để đo lường kết quả của buổi tập một c&aacute;ch ch&iacute;nh x&aacute;c hơn. Đồng thời, m&igrave;nh cũng kh&ocirc;ng cần mang theo điện thoại b&ecirc;n m&igrave;nh để sử dụng GPS n&ecirc;n v&ocirc; c&ugrave;ng tiện lợi trong qu&aacute; tr&igrave;nh chơi thể thao.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-107.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Khả năng định vị vô cùng chính xác\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-107.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Khả năng định vị vô cùng chính xác\" /></a></p>\n\n<p>Để kiểm tra khả năng hoạt động của GPS, m&igrave;nh đ&atilde; bật chế độ đạp xe ngo&agrave;i trời v&agrave; đi từ Quận 6 đến T&acirc;n Ph&uacute;. Khi về đến nh&agrave;, m&igrave;nh xem dữ liệu m&agrave; đồng hồ đ&atilde; thu thập được th&igrave; kết quả chỉ c&oacute; sự ch&ecirc;nh lệch nhỏ, chứng tỏ hệ thống định vị hoạt động v&ocirc; c&ugrave;ng tốt.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-108.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Quãng đường đi được\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-108.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Quãng đường đi được\" /></a></p>\n\n<h3>Cập nhật t&igrave;nh trạng sức khỏe mọi l&uacute;c mọi nơi</h3>\n\n<p>B&ecirc;n cạnh c&aacute;c chế độ luyện tập, những chức năng theo d&otilde;i sức khỏe cũng rất đa dạng, đồng hồ c&oacute; thể đo nồng độ oxy trong m&aacute;u (<a href=\"https://www.thegioididong.com/dong-ho-thong-minh?g=do-nong-do-oxy-trong-mau-spo2\" target=\"_blank\" title=\"Xem thêm các mẫu đồng hồ thông minh sở hữu tính năng đo nồng độ oxy trong máu hiện đang bán tại thegioididong.com\">SpO2</a>), theo d&otilde;i nhịp tim 24h,&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-theo-doi-giac-ngu\" target=\"_blank\" title=\"Xem thêm các mẫu đồng hồ thông minh sở hữu tính năng theo dõi giấc ngủ hiện đang bán tại thegioididong.com\">theo d&otilde;i giấc ngủ</a>, theo d&otilde;i mức độ stress, chu kỳ kinh nguyệt,&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-do-nhip-tim\" title=\"Xem thêm các mẫu đồng hồ có chế độ theo dõi nhịp tim hiện đnag bán tại thegioididong.com\">đo nhịp tim</a>,... gi&uacute;p m&igrave;nh nắm bắt sự thay đổi của cơ thể một c&aacute;ch nhanh ch&oacute;ng.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-109.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Nhiều tính năng sức khỏe\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-109.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Nhiều tính năng sức khỏe\" /></a></p>\n\n<p>M&igrave;nh đ&atilde; tiến h&agrave;nh đo nhịp tim v&agrave; SpO2 tr&ecirc;n Redmi Watch 2 Lite sau đ&oacute; lấy kết quả so s&aacute;nh với m&aacute;y đo y tế để kiểm tra t&iacute;nh ch&iacute;nh x&aacute;c. Thực tế con số m&agrave; hai thiết bị cho ra cũng kh&ocirc;ng c&oacute; sự ch&ecirc;nh lệch qu&aacute; lớn, ho&agrave;n to&agrave;n c&oacute; thể tham khảo để chăm s&oacute;c sức khỏe một c&aacute;ch tốt hơn.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-110.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Đo SpO2 trên máy\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-110.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Đo SpO2 trên máy\" /></a></p>\n\n<p>M&igrave;nh cũng thường xuy&ecirc;n sử dụng chế độ theo d&otilde;i giấc ngủ để biết được số giờ ngủ, t&igrave;nh trạng ngủ, chất lượng giấc ngủ,... từ đ&oacute; đề xuất giấc ngủ ti&ecirc;u chuẩn để m&igrave;nh c&oacute; thể điều chỉnh cho ph&ugrave; hợp với nhu cầu của cơ thể.&nbsp;</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-111.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Theo dõi giấc ngủ\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-111.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Theo dõi giấc ngủ\" /></a></p>\n\n<h3>Khả năng kết nối ổn định</h3>\n\n<p>Xiaomi Redmi Watch 2 Lite được trang bị phương thức kết nối kh&ocirc;ng d&acirc;y Bluetooth v5.0 cho khả năng gh&eacute;p nối nhanh ch&oacute;ng với điện thoại sử dụng hệ điều h&agrave;nh Android 6.0 v&agrave; iOS 10 trở l&ecirc;n.&nbsp;</p>\n\n<p>Tải ứng dụng&nbsp;Mi Fitness: tr&ecirc;n&nbsp;<a href=\"https://play.google.com/store/apps/details?id=com.xiaomi.wearable&amp;hl=vi&amp;gl=US\" target=\"_blank\" title=\"Tải ứng dụng Mi Fitness trên CH Play\">CH Play</a>&nbsp;| tr&ecirc;n&nbsp;<a href=\"https://apps.apple.com/vn/app/xiaomi-wear-lite/id1493500777\" target=\"_blank\" title=\"Tải ứng dụng Mi Fitness trên App Store\">App Store</a></p>\n\n<p>Trước ti&ecirc;n m&igrave;nh cần phải tải Mi Fitness tr&ecirc;n điện thoại rồi tiến h&agrave;nh gh&eacute;p nối với Xiaomi Redmi Watch 2 Lite, nhập đầy đủ th&ocirc;ng tin cần thiết l&agrave; đ&atilde; sử dụng được. C&aacute;c thao t&aacute;c cũng kh&aacute; đơn giản, giao diện của ứng dụng được thiết kế gọn g&agrave;ng, những người lần đầu sử dụng thiết bị Xiaomi như m&igrave;nh cũng l&agrave;m quen rất nhanh.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-112.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Kết nối với ứng dụng Mi Fitness\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-112.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Kết nối với ứng dụng Mi Fitness\" /></a></p>\n\n<p>Đồng hồ c&oacute; thể nhận được tin nhắn, th&ocirc;ng b&aacute;o cuộc gọi đến v&agrave; th&ocirc;ng b&aacute;o từ c&aacute;c ứng dụng v&ocirc; c&ugrave;ng nhanh ch&oacute;ng gần như đồng thời với điện thoại. Theo cảm nhận của m&igrave;nh ph&ocirc;ng chữ của tin nhắn v&agrave; th&ocirc;ng b&aacute;o kh&aacute; r&otilde; r&agrave;ng, kh&ocirc;ng bị lỗi ph&ocirc;ng hay xuống d&ograve;ng đột ngột, rất dễ xem.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-113.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Nhận tin nhắn\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-113.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Nhận tin nhắn\" /></a></p>\n\n<p>Tuy kh&ocirc;ng thể trả lời tin nhắn v&agrave; cuộc gọi ngay tr&ecirc;n đồng hồ nhưng với mức gi&aacute; v&ocirc; c&ugrave;ng rẻ th&igrave; sản phẩm n&agrave;y đ&atilde; trang bị đầy đủ c&aacute;c t&iacute;nh năng cần thiết. Từ khi sử dụng smartwatch, t&igrave;nh trạng bỏ lỡ cuộc gọi hay tin nhắn của m&igrave;nh đ&atilde; được giảm đ&aacute;ng kể, đ&acirc;y l&agrave; một thiết bị hỗ trợ kh&aacute; tốt cho người cần kiểm tra điện thoại thường xuy&ecirc;n.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-114.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Thông báo cuộc gọi\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-114.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Thông báo cuộc gọi\" /></a></p>\n\n<h3>Thời lượng pin đủ d&ugrave;ng trong nhiều ng&agrave;y</h3>\n\n<p>Theo h&atilde;ng c&ocirc;ng bố, Xiaomi Redmi Watch 2 Lite được trang bị vi&ecirc;n pin c&oacute; dung lượng&nbsp;<strong>262 mAh&nbsp;</strong>c&oacute; thể hoạt động khoảng&nbsp;<strong>10 ng&agrave;y</strong>&nbsp;trong điều kiện ti&ecirc;u chuẩn,&nbsp;<strong>14 giờ</strong>&nbsp;nếu bật GPS li&ecirc;n tục khi chơi thể thao v&agrave;&nbsp;<strong>sạc đầy trong 3 giờ</strong>. Tuy nhi&ecirc;n thời gian sử dụng thực tế sẽ c&oacute; sự ch&ecirc;nh lệch t&ugrave;y v&agrave;o c&aacute;ch sử dụng của mỗi người d&ugrave;ng.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-116.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Thời lượng pin\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-116.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Thời lượng pin\" /></a></p>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh\" target=\"_blank\" title=\"Xem thêm các mẫu đồng hồ thông minh đang bán tại thegioididong.com\">Đồng hồ th&ocirc;ng minh</a>&nbsp;c&oacute; chuẩn&nbsp;<a href=\"https://www.thegioididong.com/hoi-dap/tim-hieu-chuan-khang-nuoc-5-atm-1053163#hmenuid2\" target=\"_blank\" title=\"Tìm hiểu chuẩn kháng nước 5 ATM tại Thế Giới Di Động\">kh&aacute;ng nước 5 ATM</a>&nbsp;n&ecirc;n m&igrave;nh rất y&ecirc;n t&acirc;m đeo khi rửa tay, tắm hoặc bơi ở v&ugrave;ng nước n&ocirc;ng. Tuy nhi&ecirc;n, theo m&igrave;nh để đảm bảo khả năng hoạt động v&agrave; sử dụng thiết bị d&agrave;i l&acirc;u bạn vẫn n&ecirc;n hạn chế để thiết bị tiếp x&uacute;c với nước, kh&ocirc;ng sử dụng thiết bị trong ph&ograve;ng tắm hơi, nguồn nước n&oacute;ng, đi lặn, d&ograve;ng nước mạnh,...</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-117.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Kháng nước\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-117.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Kháng nước\" /></a></p>\n\n<h3>Đa dạng mặt đồng hồ v&agrave; tiện &iacute;ch th&ocirc;ng minh</h3>\n\n<p>Xiaomi Redmi Watch 2 Lite được trang bị hơn&nbsp;<strong>100 mặt đồng hồ</strong>&nbsp;để người d&ugrave;ng dễ d&agrave;ng thay đổi cho ph&ugrave; hợp với t&acirc;m trạng v&agrave; trang phục. Thao t&aacute;c đổi mặt đồng hồ cũng kh&aacute; đơn giản, bạn chỉ cần ấn giữ m&agrave;n h&igrave;nh trong v&agrave;i gi&acirc;y sau đ&oacute; lựa chọn giao diện hoặc bằng ứng dụng tr&ecirc;n điện thoại.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-118.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Nhiều mặt đồng hồ\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-118.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Nhiều mặt đồng hồ\" /></a></p>\n\n<p>Đồng hồ c&ograve;n c&oacute; nhiều t&iacute;nh năng v&ocirc; c&ugrave;ng tiện lợi cho người d&ugrave;ng tha hồ kh&aacute;m ph&aacute; như: điều khiển chơi nhạc, t&igrave;m điện thoại, dự b&aacute;o thời tiết, n&acirc;ng cổ tay s&aacute;ng m&agrave;n h&igrave;nh, bấm giờ,... gi&uacute;p n&acirc;ng cao chất lượng cuộc sống.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-119.jpg\" onclick=\"return false;\"><img alt=\"Xiaomi Redmi Watch 2 Lite - Nhiều tiện ích thông minh\" src=\"https://cdn.tgdd.vn/Products/Images/7077/262620/dong-ho-thong-minh-redmi-watch-2-lite-119.jpg\" title=\"Xiaomi Redmi Watch 2 Lite - Nhiều tiện ích thông minh\" /></a></p>\n\n<p>Với mức gi&aacute; chưa đến 1.5 triệu đồng Xiaomi Redmi Watch 2 Lite vẫn được trang bị rất nhiều t&iacute;nh năng th&ocirc;ng minh, hệ thống định vị h&agrave;ng đầu, vi&ecirc;n pin lớn,... chắc chắn sẽ mang lại sự h&agrave;i l&ograve;ng cho những người y&ecirc;u th&iacute;ch luyện tập thể thao v&agrave; muốn theo d&otilde;i sức khỏe ngay tại nh&agrave;.&nbsp;</p>\n\n<p>&nbsp;',_binary '\0'),(105,'Đồng hồ thông minh Garmin Fenix 7X Pro Solar Titanium',_binary 'data:image/jpeg;base64,','ON',18,'2023-11-01 18:16:18','2023-11-01 18:16:18','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary '><a href=\"https://www.thegioididong.com/dong-ho-thong-minh/garmin-fenix-7x-pro-solar-titanium\" target=\"_blank\" title=\"Đồng hồ thông minh Garmin Fenix 7X Pro Solar Titanium tại Thế Giới Di Động\">Đồng hồ th&ocirc;ng minh Garmin Fenix 7X Pro Solar Titanium</a>&nbsp;sẽ l&agrave; một thiết bị hỗ trợ tuyệt vời d&agrave;nh cho những bạn y&ecirc;u th&iacute;ch c&aacute;c m&ocirc;n thể thao ngo&agrave;i trời. T&iacute;ch hợp th&ecirc;m c&aacute;c cảm biến theo d&otilde;i sức khỏe ti&ecirc;n tiến, hệ thống định vị h&agrave;ng đầu mang đến cho người d&ugrave;ng những trải nghiệm tuyệt vời.</h3>\n\n<h3>Hỗ trợ nhiều chế độ thể thao chuy&ecirc;n nghiệp</h3>\n\n<p>Chiếc đồng hồ th&ocirc;ng minh Garmin Fenix n&agrave;y được trang bị rất nhiều chế độ thể thao như: Đạp xe, chạy, leo n&uacute;i, bơi lội, golf, b&oacute;ng đ&aacute;,... cho người d&ugrave;ng tập luyện theo sở th&iacute;ch. Đồng hồ c&ograve;n t&iacute;ch hợp b&agrave;i tập HIIT bao gồm: AMRAP, EMOM, Tabata v&agrave; c&aacute;c b&agrave;i tập t&ugrave;y chỉnh cho bạn luyện tập hiệu quả, đẩy nhanh qu&aacute; tr&igrave;nh đốt ch&aacute;y mỡ thừa.</p>\n\n<p>Thiết bị được t&iacute;ch hợp kho&nbsp;<strong>B&agrave;i tập h&igrave;nh động (Animated Workouts)&nbsp;</strong>cho c&aacute;c m&ocirc;n như: Pilates, yoga, cardio,... gi&uacute;p bạn thực hiện c&aacute;c thao t&aacute;c ch&iacute;nh x&aacute;c, n&acirc;ng cao hiệu quả luyện tập v&agrave; hạn chế chấn thương. Đồng hồ c&ograve;n c&oacute; một huấn luyện vi&ecirc;n ảo&nbsp;<strong>Garmin Coach</strong>&nbsp;sẽ gi&uacute;p người d&ugrave;ng đưa ra kế hoạch v&agrave; hướng dẫn luyện tập ph&ugrave; hợp.&nbsp;</p>\n\n<h3>Đa dạng t&iacute;nh năng thể thao cao cấp</h3>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-garmin\" target=\"_blank\" title=\"Xem thêm các đồng hồ thông minh Garmin đang kinh doanh tại Thế Giới Di Động\">Đồng hồ th&ocirc;ng minh Garmin</a>&nbsp;c&ograve;n được trang bị nhiều t&iacute;nh năng thể thao cao cấp gi&uacute;p người d&ugrave;ng n&acirc;ng cao hiệu suất v&agrave; đảm bảo an to&agrave;n khi tập luyện. Chức năng&nbsp;<strong>Chiến lược về nhịp độ</strong>&nbsp;(PacePro) cho ph&eacute;p bạn tạo chiến lược nhịp độ chạy ph&ugrave; hợp với th&oacute;i quen c&aacute; nh&acirc;n v&agrave; địa h&igrave;nh m&agrave; bạn sẽ chạy gi&uacute;p bạn đạt được một kết quả tốt nhất.</p>\n\n<p>T&iacute;nh năng<strong>&nbsp;Sẵn s&agrave;ng luyện tập (Training Readiness)</strong>&nbsp;hoạt động bằng c&aacute;ch thu thập dữ liệu giấc ngủ, cường độ tập luyện, tốc độ cơ thể phục hồi,... để x&aacute;c định xem bạn th&iacute;ch hợp để tập luyện cường độ cao hay chỉ luyện tập vừa phải.</p>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-the-thao-chuyen-nghiep\" target=\"_blank\" title=\"Xem thêm đồng hồ thông minh thể thao chuyên nghiệp tại Thế Giới Di Động\">Đồng hồ thể thao chuy&ecirc;n nghiệp</a>&nbsp;sẽ đ&aacute;nh gi&aacute; hiệu suất luyện tập của bạn th&ocirc;ng qua c&aacute;c chỉ số n&acirc;ng cao như VO2 max, khối lượng luyện tập, calories ti&ecirc;u thụ,... Kết hợp c&ugrave;ng&nbsp;<strong>Trạng th&aacute;i luyện tập (Training Status)</strong>&nbsp;sẽ gi&uacute;p bạn x&aacute;c định được bản th&acirc;n đang luyện tập ở trạng th&aacute;i đạt đỉnh cao hay qu&aacute; mức.</p>\n\n<p><strong>Khuyến c&aacute;o thời gian phục hồi (Recovery Time Advisor)</strong>&nbsp;gi&uacute;p người d&ugrave;ng nắm r&otilde; t&igrave;nh trạng sức khỏe sau khi luyện tập, thời điểm cơ thể phục hồi v&agrave; sẵn s&agrave;ng tham gia c&aacute;c hoạt động kế tiếp, hạn chế qu&aacute; sức khi luyện tập với cường độ cao.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/308517/garmin-fenix-7x-pro-solar-titanium-den-4-fix.jpg\" onclick=\"return false;\"><img alt=\"Garmin Fenix 7X Pro Solar Titanium - Thể thao chuyên nghiệp\" src=\"https://cdn.tgdd.vn/Products/Images/7077/308517/garmin-fenix-7x-pro-solar-titanium-den-4-fix.jpg\" title=\"Garmin Fenix 7X Pro Solar Titanium - Thể thao chuyên nghiệp\" /></a></p>\n\n<h3>Tập luyện ngo&agrave;i trời hiệu quả hơn với định vị đa tần số</h3>\n\n<p>Garmin Fenix 7X Pro Solar Titanium sở hữu hệ thống vệ tinh đa dạng bao gồm:&nbsp;<strong>GPS</strong>,&nbsp;<strong>GLONASS</strong>,&nbsp;<strong>Galileo</strong>, kết hợp c&ugrave;ng<strong>&nbsp;c&ocirc;ng nghệ SATIQ</strong>,&nbsp;<strong>cảm biến ABC</strong>,... sẽ gi&uacute;p định vị ch&iacute;nh x&aacute;c, đẩy nhanh tốc độ bắt t&iacute;n hiệu GPS ở nhiều điều kiện m&ocirc;i trường. Với hệ thống định vị ti&ecirc;n tiến n&agrave;y, đồng hồ sẽ một trợ thủ đắc lực của người d&ugrave;ng khi tham gia c&aacute;c m&ocirc;n thể thao ngo&agrave;i trời như chạy bộ, đạp xe, leo n&uacute;i,...</p>\n\n<p>T&iacute;nh năng<strong>&nbsp;LiveTrack</strong>&nbsp;sẽ gi&uacute;p bạn được an to&agrave;n hơn những khi tập luyện một m&igrave;nh, bởi thiết bị sẽ cho ph&eacute;p người d&ugrave;ng chia sẻ vị tr&iacute; theo thời gian thực v&agrave; kế hoạch tập luyện cho bạn b&egrave;, gia đ&igrave;nh.</p>\n\n<p>B&ecirc;n cạnh đ&oacute;,&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh\" target=\"_blank\" title=\"Xem thêm các sản phẩm đồng hồ thông minh đang kinh doanh tại Thế Giới Di Động\">đồng hồ th&ocirc;ng minh</a>&nbsp;c&ograve;n t&iacute;ch hợp nhiều loại bản đồ hỗ trợ người d&ugrave;ng tham gia c&aacute;c m&ocirc;n thể thao ngo&agrave;i trời như: Bản đồ Topo đa lục địa, bản đồ Skyview, bản đồ s&acirc;n Golf, Outdoor Maps+,... C&aacute;c bản đồ cũng được thường xuy&ecirc;n cập nhật đảm bảo sự mới mẻ v&agrave;&nbsp;đầy đủ cho người d&ugrave;ng.&nbsp;</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/308517/garmin-fenix-7x-pro-solar-titanium-den-6-fix.jpg\" onclick=\"return false;\"><img alt=\"Garmin Fenix 7X Pro Solar Titanium - Định vị chính xác\" src=\"https://cdn.tgdd.vn/Products/Images/7077/308517/garmin-fenix-7x-pro-solar-titanium-den-6-fix.jpg\" title=\"Garmin Fenix 7X Pro Solar Titanium - Định vị chính xác\" /></a></p>\n\n<h3>Sử dụng cảm biến hiện đại, hỗ trợ theo d&otilde;i sức khỏe li&ecirc;n tục</h3>\n\n<p><strong>B&aacute;o c&aacute;o buổi s&aacute;ng (Morning Report</strong>) l&agrave; một chức năng hữu &iacute;ch tr&ecirc;n đồng hồ khi cập nhật đầy đủ th&ocirc;ng tin tổng quan của cơ thể như giấc ngủ, khả năng tập luyện, trạng th&aacute;i HRV, thời tiết,... để gi&uacute;p bạn biết được c&oacute; n&ecirc;n tập luyện v&agrave;o ng&agrave;y h&ocirc;m đ&oacute; hay kh&ocirc;ng. Đồng hồ c&ograve;n hỗ trợ t&iacute;nh năng&nbsp;<strong>Health Snapshot</strong>&nbsp;gi&uacute;p bạn ghi lại c&aacute;c chỉ số sức khỏe quan trọng, bạn c&oacute; thể chia sẻ với b&aacute;c sĩ c&aacute; nh&acirc;n để chăm s&oacute;c cơ thể hiệu quả nhất.</p>\n\n<p>Cảm biến nhịp tim tr&ecirc;n cổ tay<strong>&nbsp;Garmin Elevate</strong>&nbsp;c&oacute; khả năng đo v&agrave; theo d&otilde;i nhịp tim của người d&ugrave;ng, trường hợp nhận thấy nhịp tim qu&aacute; cao hoặc qu&aacute; thấp sẽ đưa ra cảnh b&aacute;o để kịp thời điều chỉnh hoạt động.</p>\n\n<p>B&ecirc;n cạnh đ&oacute;, đồng hồ th&ocirc;ng minh Garmin c&ograve;n hỗ trợ theo d&otilde;i nhiều chỉ số sức khỏe kh&aacute;c như: Đo lượng ti&ecirc;u thụ oxy tối đa (VO2 max), theo d&otilde;i v&agrave; chấm điểm giấc ngủ, đo nồng độ oxy trong m&aacute;u (SpO2), theo d&otilde;i mức độ stress, nhịp thở, chu kỳ ph&aacute;i nữ,...&nbsp;</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/308517/garmin-fenix-7x-pro-solar-titanium-den-3-fix.jpg\" onclick=\"return false;\"><img alt=\"Garmin Fenix 7X Pro Solar Titanium - Cảm biến sức khỏe\" src=\"https://cdn.tgdd.vn/Products/Images/7077/308517/garmin-fenix-7x-pro-solar-titanium-den-3-fix.jpg\" title=\"Garmin Fenix 7X Pro Solar Titanium - Cảm biến sức khỏe\" /></a></p>\n\n<h3>Kiểu d&aacute;ng hiện đại, chất liệu cao cấp</h3>\n\n<p>Đồng hồ Garmin Fenix được chế t&aacute;c bền bỉ với phần khung viền<strong>&nbsp;Titanium</strong>&nbsp;v&ocirc; c&ugrave;ng chắc chắn v&agrave; tạo n&ecirc;n sự sang trọng cho diện mạo b&ecirc;n ngo&agrave;i. Kết hợp<strong>&nbsp;k&iacute;nh cường lực Sapphire&nbsp;</strong>gi&uacute;p tăng khả năng bảo vệ thiết bị trước những va chạm trong qu&aacute; tr&igrave;nh tập luyện, sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng người d&ugrave;ng trong nhiều điều kiện m&ocirc;i trường. Đồng hồ cũng sử dụng d&acirc;y đeo silicone dẻo dai, &ocirc;m trọn cổ tay người d&ugrave;ng nhờ t&iacute;nh linh hoạt cao.</p>\n\n<p><strong>M&agrave;n h&igrave;nh cảm ứng&nbsp;</strong>gi&uacute;p thao t&aacute;c điều khiển diễn ra trơn tru, 2 cạnh b&ecirc;n của đồng hồ c&ograve;n được trang bị&nbsp;<strong>5 n&uacute;t chức năng&nbsp;</strong>gi&uacute;p người d&ugrave;ng thực hiện một số thao t&aacute;c điều hướng, t&ugrave;y chọn dễ d&agrave;ng hơn.</p>\n\n<p>Về phần hiển thị, Garmin đ&atilde; trang bị cho chiếc đồng hồ&nbsp;<a href=\"https://www.thegioididong.com/tin-tuc/the-manh-giup-garmin-dan-dau-dong-ho-gps-1443106\" target=\"_blank\" title=\"Màn hình MIP là gì?\">m&agrave;n h&igrave;nh MIP</a>&nbsp;chống ch&oacute;i với k&iacute;ch thước<strong>&nbsp;1.4 inch</strong>, độ ph&acirc;n giải<strong>&nbsp;280 x 280 pixels&nbsp;</strong>mang đến khả năng hiển&nbsp;thị nội dung r&otilde; n&eacute;t, dễ d&agrave;ng xem được c&aacute;c th&ocirc;ng tin tr&ecirc;n m&agrave;n h&igrave;nh ngay cả khi ở ngo&agrave;i trời với độ s&aacute;ng cao.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/308517/garmin-fenix-7x-pro-solar-titanium-den-2-1.jpg\" onclick=\"return false;\"><img alt=\"Garmin Fenix 7X Pro Solar Titanium - Kiểu dáng thể thao\" src=\"https://cdn.tgdd.vn/Products/Images/7077/308517/garmin-fenix-7x-pro-solar-titanium-den-2-1.jpg\" title=\"Garmin Fenix 7X Pro Solar Titanium - Kiểu dáng thể thao\" /></a></p>\n\n<h3>Thời lượng pin d&agrave;i, hỗ trợ sạc bằng năng lượng mặt trời</h3>\n\n<p>Bạn c&oacute; thể sử dụng chiếc đồng hồ n&agrave;y&nbsp;<strong>khoảng 28 ng&agrave;y</strong>&nbsp;(ở chế độ th&ocirc;ng minh)&nbsp;hoặc&nbsp;<strong>khoảng 89 giờ</strong>&nbsp;(ở chế độ GPS) chỉ với một lần sạc đầy pin (theo c&ocirc;ng bố từ h&atilde;ng), hạn chế t&igrave;nh trạng hết pin giữa chừng trong những chuyến đi hay buổi tập luyện, đảm bảo cho người d&ugrave;ng trải nghiệm liền mạch. B&ecirc;n cạnh đ&oacute;, thiết bị c&ograve;n t&iacute;ch hợp th&ecirc;m khả năng sạc pin bằng năng lượng mặt trời cho thời gian sử dụng d&agrave;i hơn.&nbsp;</p>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-garmin-fenix\" title=\"Xem thêm đồng hồ Garmin Fenix đang bán tại thegioididong.com\">Đồng hồ th&ocirc;ng minh Garmin Fenix</a>&nbsp;sẽ lu&ocirc;n&nbsp;đồng h&agrave;nh c&ugrave;ng bạn bất kể điều kiện m&ocirc;i trường nhờ đạt chuẩn&nbsp;<strong>chống nước 10 ATM</strong>,&nbsp;cho ph&eacute;p bạn đeo khi đi bơi, lặn ở v&ugrave;ng nước n&ocirc;ng,... Tuy nhi&ecirc;n, để đảm bảo thiết bị hoạt động một c&aacute;ch tốt nhất, bạn kh&ocirc;ng n&ecirc;n đeo đồng hồ v&agrave;o ph&ograve;ng tắm hơi, tiếp x&uacute;c với nước n&oacute;ng,...</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/308517/garmin-fenix-7x-pro-solar-titanium-den-7-fix.jpg\" onclick=\"return false;\"><img alt=\"Garmin Fenix 7X Pro Solar Titanium - Pin và chống nước\" src=\"https://cdn.tgdd.vn/Products/Images/7077/308517/garmin-fenix-7x-pro-solar-titanium-den-7-fix.jpg\" title=\"Garmin Fenix 7X Pro Solar Titanium - Pin và chống nước\" /></a></p>\n\n<p>B&ecirc;n cạnh những chức năng ch&iacute;nh về thể thao, định vị v&agrave; sức khỏe th&igrave; đồng hồ th&ocirc;ng minh Garmin Fenix 7X Pro Solar Titanium c&ograve;n được trang bị nhiều tiện &iacute;ch hỗ trợ cho cuộc sống hằng ng&agrave;y như: B&aacute;o thức, t&igrave;m điện thoại, dự b&aacute;o thời tiết, lưu trữ nhạc, trả lời nhanh tin nhắn c&oacute; sẵn (chỉ hoạt động tr&ecirc;n Android),... đ&acirc;y sẽ l&agrave; một bạn đồng h&agrave;nh ho&agrave;n hảo cho những vận động vi&ecirc;n hoặc những ai y&ecirc;u th&iacute;ch thể thao, kh&aacute;m ph&aacute;.',_binary '\0');
INSERT INTO `product` VALUES (106,'Đồng hồ thông minh Apple Watch Ultra 2 LTE',_binary 'data:image/jpeg;base64,','ON',16,'2023-11-01 18:32:13','2023-11-01 18:32:13','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary '><a href=\"https://www.thegioididong.com/dong-ho-thong-minh/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m\" target=\"_blank\" title=\"Apple Watch Ultra 2 LTE 49mm tại Thế Giới Di Động\">Apple Watch Ultra 2 LTE 49mm viền Titanium d&acirc;y Trail size S/M</a>&nbsp;l&agrave; một trong những mẫu đồng hồ th&ocirc;ng minh cao cấp nhất của Apple được ra mắt v&agrave;o năm 2023. Sở hữu ngoại h&igrave;nh thời thượng, độ bền vượt trội sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng người d&ugrave;ng. Đồng thời, b&ecirc;n trong cũng được n&acirc;ng cấp nhằm mang đến những trải nghiệm tốt nhất.</h3>\n\n<h3>Phong c&aacute;ch năng động, độ bền vượt trội</h3>\n\n<p>Về phần ngoại h&igrave;nh th&igrave; chiếc Apple Watch Ultra 2 n&agrave;y kh&aacute; tương đồng với&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-apple-watch-ultra\" target=\"_blank\" title=\"Xem thêm các sản phẩm Apple Watch Ultra tại Thế Giới Di Động \">Apple Watch Ultra</a>&nbsp;đ&atilde; ra mắt v&agrave;o năm 2022. Mặt đồng hồ h&igrave;nh chữ nhật với&nbsp;<strong>k&iacute;ch thước 49 mm</strong>&nbsp;sẽ ph&ugrave; hợp với cổ tay của c&aacute;c bạn nam hơn. Khung viền&nbsp;<strong>Titanium</strong>&nbsp;v&ocirc; c&ugrave;ng chắc chắn, &iacute;t bị m&oacute;p m&eacute;o khi c&oacute; va chạm trong qu&aacute; tr&igrave;nh sử dụng.</p>\n\n<p>Đồng hồ sử dụng d&acirc;y&nbsp;<strong>Trail Loop&nbsp;</strong>được thiết kế d&agrave;nh ri&ecirc;ng cho c&aacute;c hoạt động ngo&agrave;i trời. D&acirc;y đồng hồ được l&agrave;m từ sợi nylon mỏng v&agrave; nhẹ tạo cảm gi&aacute;c thoải m&aacute;i khi đeo. Chất liệu t&aacute;i chế c&oacute; lượng ph&aacute;t thải carbon cực thấp, th&ecirc;m phần th&acirc;n thiện với m&ocirc;i trường. D&acirc;y sử dụng kh&oacute;a d&aacute;n c&oacute; độ chắc chắn cao, kh&ocirc;ng bị bung ra khi vận động v&agrave; rất dễ d&agrave;ng điều chỉnh độ rộng khi đeo.</p>\n\n<p><strong>N&uacute;t Digital Crown</strong>&nbsp;c&oacute; thiết kế tương tự thế hệ trước, xoay để thực hiện nhanh một số thao t&aacute;c điều khiển như quay lại m&agrave;n h&igrave;nh ch&iacute;nh, điều chỉnh &acirc;m lượng, mở ứng dụng,... Một n&acirc;ng cấp nhỏ ở phi&ecirc;n bản n&agrave;y l&agrave; bạn c&oacute; thể tạm thời tăng gấp đ&ocirc;i độ s&aacute;ng của đ&egrave;n pin trong điều kiện tối bằng c&aacute;ch xoay Digital Crown.&nbsp;</p>\n\n<p><strong>N&uacute;t bấm Side Part</strong>&nbsp;gi&uacute;p bạn ra v&agrave;o ứng dụng gần nhất, tắt/mở nguồn v&agrave; thực hiện cuộc gọi SOS một c&aacute;ch nhanh ch&oacute;ng. Cả Side Part v&agrave; Digital Crown đều đặt trong một c&aacute;i gờ nhằm hạn chế hư hại khi c&oacute; va chạm xảy ra v&agrave; tạo sự thuận tiện cho thao t&aacute;c điều khiển của người d&ugrave;ng.</p>\n\n<p><strong>N&uacute;t H&agrave;nh Động</strong>&nbsp;c&oacute; m&agrave;u cam v&ocirc; c&ugrave;ng nổi bật nằm b&ecirc;n tr&aacute;i mặt đồng hồ bạn c&oacute; thể thiết lập một chức năng theo th&oacute;i quen sử dụng, tối ưu thời gian điều hướng trong qu&aacute; tr&igrave;nh sử dụng. Khi bạn nhấn v&agrave; giữ n&uacute;t h&agrave;nh động th&igrave; c&ograve;i b&aacute;o động sẽ vang l&ecirc;n với mức &acirc;m thanh l&agrave; 86 db.</p>\n\n<p>Apple Watch Ultra 2 đ&atilde; vượt qua tất cả c&aacute;c b&agrave;i kiểm tra của&nbsp;<strong>MIL-STD 810H</strong>. Điều n&agrave;y c&oacute; nghĩa l&agrave; đồng hồ c&oacute; thể chịu được những va đập mạnh, nhiệt độ khắc nghiệt, độ ẩm cao v&agrave; bụi bẩn. Trở th&agrave;nh một lựa chọn l&yacute; tưởng cho những người y&ecirc;u th&iacute;ch c&aacute;c hoạt động ngo&agrave;i trời, chẳng hạn như leo n&uacute;i, đi bộ đường d&agrave;i v&agrave; chạy bộ.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054747.jpg\" onclick=\"return false;\"><img alt=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - Thiết kế \" src=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054747.jpg\" title=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - Thiết kế \" /></a></p>\n\n<h3>M&agrave;n h&igrave;nh lớn v&agrave; s&aacute;ng nhất của Apple</h3>\n\n<p>Apple đ&atilde; trang bị cho chiếc đồng hồ n&agrave;y&nbsp;<strong>m&agrave;n h&igrave;nh OLED&nbsp;</strong>với k&iacute;ch thước l&ecirc;n đến&nbsp;<strong>1.92 inch&nbsp;</strong>v&ocirc; c&ugrave;ng rộng r&atilde;i cho c&aacute;c thao t&aacute;c điều khiển, th&ocirc;ng tin được hiển thị nhiều hơn. Độ ph&acirc;n giải&nbsp;<strong>410 x 502 pixels</strong>&nbsp;cung cấp nội dung r&otilde; n&eacute;t cho người d&ugrave;ng, m&agrave;u sắc v&ocirc; c&ugrave;ng ch&acirc;n thật.&nbsp;</p>\n\n<p>Độ s&aacute;ng m&agrave;n h&igrave;nh l&ecirc;n đến<strong>&nbsp;3000 nits&nbsp;</strong>gi&uacute;p bạn th&ocirc;ng tin dễ d&agrave;ng dưới &aacute;nh nắng gắt, độ s&aacute;ng m&agrave;n h&igrave;nh tối thiểu&nbsp;<strong>1 nit&nbsp;</strong>n&ecirc;n những l&uacute;c đi v&agrave;o rạp xem phim, bạn c&oacute; thể sử dụng đồng hồ m&agrave; kh&ocirc;ng g&acirc;y ảnh hưởng đến những người xung quanh.</p>\n\n<p><strong>Chế độ ban đ&ecirc;m&nbsp;</strong>tr&ecirc;n Apple Watch Ultra 2 sẽ tự động k&iacute;ch hoạt trong b&oacute;ng tối, m&agrave;n h&igrave;nh đồng hồ sẽ chuyển sang m&agrave;u đỏ gi&uacute;p giảm lượng &aacute;nh s&aacute;ng xanh ph&aacute;t ra, nhưng vẫn đảm bảo khả năng hiển thị v&agrave; g&oacute;p phần tiết kiệm pin.</p>\n\n<p><strong>M&agrave;n h&igrave;nh lu&ocirc;n hiển thị</strong>&nbsp;(<strong>Always On Display</strong>) cho ph&eacute;p m&agrave;n h&igrave;nh đồng hồ lu&ocirc;n s&aacute;ng ngay cả khi người d&ugrave;ng kh&ocirc;ng tương t&aacute;c. Bạn c&oacute; thể dễ d&agrave;ng xem giờ khi đồng hồ đang ở trạng th&aacute;i nghỉ, rất tiện lợi khi đang l&agrave;m việc, tập thể dục hoặc trong c&aacute;c t&igrave;nh huống kh&ocirc;ng thể chạm để đ&aacute;nh thức đồng hồ.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-40-1.jpg\" onclick=\"return false;\"><img alt=\"Apple Watch Ultra 2 LTE 49mm - Màn hình\" src=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-40-1.jpg\" title=\"Apple Watch Ultra 2 LTE 49mm - Màn hình\" /></a></p>\n\n<h3>Trang bị chip S9 SiP ho&agrave;n to&agrave;n mới, mạnh mẽ hơn</h3>\n\n<p>Chip&nbsp;<strong>Apple S9 SiP</strong>&nbsp;c&oacute;<strong>&nbsp;5.6 tỷ b&oacute;ng b&aacute;n dẫn</strong>&nbsp;- nhiều hơn 60% so với thế hệ trước gi&uacute;p cải thiện hiệu suất hoạt động. Theo c&ocirc;ng bố từ h&atilde;ng th&igrave; CPU sẽ c&oacute; 4 l&otilde;i Neural Engine, đẩy nhanh tốc độ xử l&yacute; của CPU v&agrave; GPU nhanh hơn gấp 2 lần so với con chip S8 tr&ecirc;n Apple Watch Series 8.</p>\n\n<p>Ở phi&ecirc;n bản<strong>&nbsp;WatchOS mới nhất&nbsp;</strong>c&oacute; giao diện mang phong c&aacute;ch hiện đại v&agrave; tối giản, menu được sắp xếp lại thuận tiện cho việc sử dụng hơn. Người d&ugrave;ng c&oacute; thể xem th&ocirc;ng tin nhanh ch&oacute;ng chỉ với thao t&aacute;c cuộn n&uacute;t Digital Crown mở t&iacute;nh năng&nbsp;<strong>Ngăn xếp th&ocirc;ng minh (Smart Stack)</strong>. C&aacute;c th&ocirc;ng tin trong Smart Stack sẽ hiển thị dựa tr&ecirc;n bối cảnh sử dụng của người d&ugrave;ng.</p>\n\n<p>WatchOS 10 cũng đ&atilde; ra mắt th&ecirc;m hai mặt đồng hồ mới, một theo phong c&aacute;ch nghệ thuật, c&ograve;n một c&aacute;i th&igrave; v&ocirc; c&ugrave;ng dễ thương với t&ecirc;n gọi l&agrave; Bảng M&agrave;u v&agrave; Snoopy. Đặc biệt l&agrave; mặt đồng hồ Bảng M&agrave;u sẽ thay đổi m&agrave;u sắc hiển thị khi thời gian thay đổi gi&uacute;p m&agrave;n h&igrave;nh đồng hồ của bạn th&ecirc;m sống động.</p>\n\n<p>T&iacute;nh năng&nbsp;<strong>Chạm hai lần</strong>&nbsp;(<strong>Double Tap</strong>) gi&uacute;p bạn tương t&aacute;c nhanh ch&oacute;ng với Apple Watch Ultra 2 m&agrave; kh&ocirc;ng cần chạm v&agrave;o m&agrave;n h&igrave;nh. Ở tay đeo đồng hồ, bạn chỉ cần chạm ng&oacute;n trỏ v&agrave; ng&oacute;n c&aacute;i với nhau 2 lần l&agrave; đ&atilde; c&oacute; thể: Nhận cuộc gọi, kết th&uacute;c cuộc gọi, tạm dừng/kết th&uacute;c bấm giờ,...&nbsp;</p>\n\n<p><strong>Lưu &yacute;:&nbsp;</strong>Apple Watch Ultra 2 tương th&iacute;ch với d&ograve;ng iPhone Xs trở l&ecirc;n v&agrave; sử dụng hệ điều h&agrave;nh iOS 17 trở l&ecirc;n.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054751.jpg\" onclick=\"return false;\"><img alt=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - Chip Apple S9\" src=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054751.jpg\" title=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - Chip Apple S9\" /></a></p>\n\n<h3>Nghe gọi th&ocirc;ng qua eSIM</h3>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-apple-watch-ultra-2\" target=\"_blank\" title=\"Xem thêm đồng hồ thông minh Apple Watch Ultra 2 tại Thế Giới Di Động\">Apple Watch Ultra 2</a>&nbsp;với t&iacute;nh năng nghe gọi độc lập n&ecirc;n c&oacute; thể thay thế điện thoại trong nhiều trường hợp. Khi bạn đang chạy bộ, tập gym hay đi dạo, bạn kh&ocirc;ng cần phải lo lắng về việc bỏ lỡ cuộc gọi quan trọng. Đồng hồ sẽ sử dụng chung số thu&ecirc; bao với điện thoại gi&uacute;p bạn lu&ocirc;n kết nối với mọi người.</p>\n\n<p>Bạn cần đăng k&yacute; dịch vụ&nbsp;<strong>MultiSIM</strong>&nbsp;của nh&agrave; mạng Viettel hoặc Vinaphone để sử dụng&nbsp;<a href=\"https://www.thegioididong.com/hoi-dap/esim-apple-watch-la-gi-cach-thiet-lap-tinh-nang-1500548\" target=\"_blank\" title=\"Tìm hiểu eSIM trên Apple Watch tại Thế Giới Di Động\">eSIM</a>&nbsp;cho Apple Watch. Để đăng k&yacute; dịch vụ n&agrave;y th&igrave; bạn cần trang bị một SIM vật l&yacute; hoặc eSIM. Khi đăng k&yacute; th&agrave;nh c&ocirc;ng th&igrave; đồng hồ c&oacute; thể sử dụng chung g&oacute;i cước 3G/4G với điện thoại. Đối với nh&agrave; mạng Vinaphone, bạn chỉ c&oacute; thể thực hiện cuộc gọi đi m&agrave; kh&ocirc;ng thể nhận cuộc gọi đến do một số ch&iacute;nh s&aacute;ch ri&ecirc;ng tư.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054749.jpg\" onclick=\"return false;\"><img alt=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - eSIM\" src=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054749.jpg\" title=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - eSIM\" /></a></p>\n\n<h3>T&iacute;ch hợp nhiều chế độ thể thao, r&egrave;n luyện thể chất hiệu quả</h3>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-the-thao-chuyen-nghiep\" target=\"_blank\" title=\"Xem thêm đồng hồ thể thao chuyên nghiệp tại Thế Giới Di Động\">Đồng hồ th&ocirc;ng minh thể thao chuy&ecirc;n nghiệp</a>&nbsp;Apple Watch Ultra 2 l&agrave; một thiết bị ho&agrave;n hảo cho những người đam m&ecirc; thể thao. Với v&ocirc; v&agrave;n chế độ luyện tập từ trong nh&agrave; đến ngo&agrave;i trời, smartwatch sẽ mang đến cho người d&ugrave;ng những trải nghiệm luyện tập tuyệt vời.</p>\n\n<p>Ứng dụng b&agrave;i tập tr&ecirc;n đồng hồ cho ph&eacute;p người d&ugrave;ng theo d&otilde;i c&aacute;c chỉ số luyện tập một c&aacute;ch chi tiết v&agrave; trực quan. C&aacute;c chỉ số n&agrave;y bao gồm nhịp tim, qu&atilde;ng đường, thời gian, lượng calo đốt ch&aacute;y,... Người d&ugrave;ng c&oacute; thể dễ d&agrave;ng theo d&otilde;i qu&aacute; tr&igrave;nh luyện tập của m&igrave;nh v&agrave; điều chỉnh cường độ luyện tập ph&ugrave; hợp.</p>\n\n<p>Ứng dụng&nbsp;<strong>La b&agrave;n</strong>&nbsp;tr&ecirc;n&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-apple\" target=\"_blank\" title=\"Xem thêm các sản phẩm Apple Watch khác tại Thế Giới Di Động\">Apple Watch</a>&nbsp;với độ ch&iacute;nh x&aacute;c cao gi&uacute;p người d&ugrave;ng x&aacute;c định phương vị bản th&acirc;n một c&aacute;ch ch&iacute;nh x&aacute;c, từ đ&oacute; c&oacute; thể định hướng đường đi một c&aacute;ch dễ d&agrave;ng. Ngo&agrave;i ra, ứng dụng c&ograve;n cho ph&eacute;p người d&ugrave;ng lưu c&aacute;c điểm tham chiếu hoặc c&aacute;c điểm đ&aacute;nh dấu cụ thể khi đến. Điều n&agrave;y gi&uacute;p người d&ugrave;ng dễ d&agrave;ng t&igrave;m lại đường đi trước đ&oacute; khi cần thiết.&nbsp;</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054754.jpg\" onclick=\"return false;\"><img alt=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - Chế độ luyện tập\" src=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054754.jpg\" title=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - Chế độ luyện tập\" /></a></p>\n\n<h3>Khả năng định vị chuẩn x&aacute;c, đảm bảo an to&agrave;n ở bất kỳ đ&acirc;u</h3>\n\n<p>Chiếc Apple Watch n&agrave;y được trang bị&nbsp;<strong>GPS băng tần k&eacute;p</strong>&nbsp;L1 v&agrave; L5, c&ugrave;ng 5 vệ tinh l&agrave;&nbsp;<strong>Galileo</strong>,&nbsp;<strong>BDS</strong>,&nbsp;<strong>GLONASS</strong>,&nbsp;<strong>GPS</strong>&nbsp;v&agrave;&nbsp;<strong>QZSS</strong>&nbsp;cho khả năng định vị ch&iacute;nh x&aacute;c tr&ecirc;n phạm vi to&agrave;n cầu. Hệ thống định vị t&acirc;n tiến n&agrave;y sẽ gi&uacute;p bạn tập luyện ngo&agrave;i trời hiệu quả, theo d&otilde;i lịch sử di chuyển, dễ d&agrave;ng t&igrave;m kiếm khi thiết bị thất lạc,...</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054755.jpg\" onclick=\"return false;\"><img alt=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - Định vị\" src=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054755.jpg\" title=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - Định vị\" /></a></p>\n\n<h3>Theo d&otilde;i sức khỏe một c&aacute;ch to&agrave;n diện</h3>\n\n<p>Apple Watch l&agrave; một chiếc đồng hồ th&ocirc;ng minh được t&iacute;ch hợp nhiều t&iacute;nh năng sức khỏe, gi&uacute;p người d&ugrave;ng theo d&otilde;i sức khỏe một c&aacute;ch to&agrave;n diện. Với c&aacute;c t&iacute;nh năng nổi bật như điện t&acirc;m đồ,&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh?g=do-nong-do-oxy-trong-mau-spo2\" target=\"_blank\" title=\"Xem thêm đồng hồ thông minh có chức năng đo SpO2 max tại Thế Giới Di Động\">đo nồng độ oxy trong m&aacute;u</a>, ước t&iacute;nh ng&agrave;y rụng trứng, chấm điểm giấc ngủ,&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-do-nhip-tim\" target=\"_blank\" title=\"Xem thêm đồng hồ thông minh có chức năng đo nhịp tim tại Thế Giới Di Động\">đo nhịp tim</a>,... th&ocirc;ng qua hệ thống cảm biến t&acirc;n tiến.</p>\n\n<p>Cảm biến nhiệt độ của Apple Watch Ultra c&oacute; thể đo nhiệt độ cơ thể người với độ ch&iacute;nh x&aacute;c cao. T&iacute;nh năng n&agrave;y c&oacute; thể được sử dụng để theo d&otilde;i t&igrave;nh trạng sức khỏe tổng thể, ph&aacute;t hiện c&aacute;c dấu hiệu của bệnh tật chẳng hạn như sốt. Đồng thời, c&ograve;n d&ugrave;ng để dự đo&aacute;n thời gian rụng trứng v&agrave; chu kỳ kinh nguyệt cho ph&aacute;i nữ hỗ trợ lập kế hoạch sinh sản hiệu quả.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054752.jpg\" onclick=\"return false;\"><img alt=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - Tiện ích sức khỏe \" src=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054752.jpg\" title=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - Tiện ích sức khỏe \" /></a></p>\n\n<h3>Chống nước vượt trội, thời lượng vừa đủ d&ugrave;ng</h3>\n\n<p>Chiếc Apple Watch Ultra n&agrave;y đạt chuẩn&nbsp;<strong>chống nước 10 ATM</strong>&nbsp;v&agrave; chứng nhận&nbsp;<strong>EN13319</strong>&nbsp;cho ph&eacute;p người d&ugrave;ng đeo khi đi bơi hoặc lặn ở độ s&acirc;u khoảng 40 m&eacute;t m&agrave; kh&ocirc;ng lo đồng hồ bị hư hại. Đối với những ai y&ecirc;u th&iacute;ch những m&ocirc;n thể thao dưới nước th&igrave; chiếc đồng hồ n&agrave;y sẽ l&agrave; một người bạn đồng h&agrave;nh l&yacute; tưởng.</p>\n\n<p>Theo th&ocirc;ng tin m&agrave; h&atilde;ng cung cấp th&igrave; chiếc&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh\" target=\"_blank\" title=\"Xem thêm nhiều sản phẩm đồng hồ thông minh tại Thế Giới Di Động\">đồng hồ th&ocirc;ng minh</a>&nbsp;n&agrave;y c&oacute; thể hoạt động li&ecirc;n tục khoảng&nbsp;<strong>36 giờ</strong>&nbsp;ở chế độ th&ocirc;ng thường hoặc&nbsp;<strong>72 giờ</strong>&nbsp;khi bạn sử dụng đồng hồ ở chế độ&nbsp;<strong>Năng lượng thấp</strong>. Lu&ocirc;n sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng bạn trong c&aacute;c hoạt động cả ng&agrave;y m&agrave; kh&ocirc;ng cần phải sạc lại.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054757.jpg\" onclick=\"return false;\"><img alt=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - Pin và Chống nước\" src=\"https://cdn.tgdd.vn/Products/Images/7077/314942/apple-watch-ultra-2-lte-49mm-vien-titanium-day-trail-size-s-m-011023-054757.jpg\" title=\"Apple Watch Ultra 2 LTE 49mm viền Titanium dây Trail size S/M - Pin và Chống nước\" /></a></p>\n\n<h3>V&ocirc; v&agrave;ng tiện &iacute;ch kh&aacute;c phục vụ người d&ugrave;ng</h3>\n\n<p>Đồng hồ th&ocirc;ng minh Apple hỗ trợ nhận th&ocirc;ng b&aacute;o từ c&aacute;c ứng dụng b&ecirc;n thứ 3 như: Zalo, Line, Viber, Messenger,... gi&uacute;p người d&ugrave;ng cập nhật tin tức, sự kiện, th&ocirc;ng b&aacute;o từ bạn b&egrave;, gia đ&igrave;nh một c&aacute;ch nhanh ch&oacute;ng. Tuy nhi&ecirc;n, những cuộc gọi từ ứng dụng th&igrave; Apple Watch sẽ kh&ocirc;ng hiển thị th&ocirc;ng b&aacute;o, trừ trường hợp cuộc gọi nhỡ.</p>\n\n<p>Để hỗ trợ người d&ugrave;ng tốt hơn trong sinh hoạt hằng ng&agrave;y th&igrave; Apple Watch Ultra 2 c&ograve;n được t&iacute;ch hợp nhiều tiện &iacute;ch kh&aacute;c như: Điều khiển chụp ảnh, đồng hồ bấm giờ, b&aacute;o thức,...</p>\n\n<p>Apple Watch Ultra 2 LTE 49mm l&agrave; một sản phẩm đồng hồ th&ocirc;ng minh cao cấp được thiết kế d&agrave;nh cho những người y&ecirc;u th&iacute;ch thể thao v&agrave; c&ocirc;ng nghệ. Với kiểu d&aacute;ng thời thượng, độ bền vượt trội c&ugrave;ng v&ocirc; v&agrave;n t&iacute;nh năng th&ocirc;ng minh th&igrave; chiếc đồng hồ n&agrave;y sẽ đ&aacute;p ứng được mọi nhu cầu của người d&ugrave;ng.',_binary '\0'),(107,'Đồng hồ thông minh Samsung Galaxy Watch6 Classic',_binary 'data:image/jpeg;base64,','ON',15,'2023-11-01 18:53:25','2023-11-01 18:53:25','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary 'Samsung Galaxy Watch6 Classic 47mm được thiết kế tối giản ph&ugrave; hợp với cuộc sống hằng ng&agrave;y của người d&ugrave;ng. T&iacute;ch hợp nhiều t&iacute;nh năng th&ocirc;ng minh để người d&ugrave;ng chăm s&oacute;c sức khỏe một c&aacute;ch hiệu quả nhất, đa dạng chế độ thể thao đ&aacute;p ứng mọi nhu cầu luyện tập.<br />\nPhong c&aacute;ch cổ điển, v&ograve;ng bezel vật l&yacute;&nbsp;<br />\nGalaxy Watch6 Classic vẫn giữ nguy&ecirc;n mặt đồng hồ tr&ograve;n quen thuộc tạo n&ecirc;n một vẻ ngo&agrave;i thanh lịch mang n&eacute;t cổ điển. Sau Galaxy Watch4 Classic th&igrave; đ&acirc;y l&agrave; sản phẩm được trang bị viền bezel vật l&yacute; tiếp theo của nh&agrave; Samsung, với thao t&aacute;c sử dụng cực đơn giản mang đến sự tiện lợi cho người d&ugrave;ng.</p>\n\n<p>Khung viền bằng th&eacute;p kh&ocirc;ng gỉ chịu lực tốt, hạn chế m&oacute;p m&eacute;o khi va chạm, kết hợp c&ugrave;ng mặt k&iacute;nh Sapphire tạo n&ecirc;n một lớp &aacute;o gi&aacute;p vững chắc hạn chế những hư hại khi bạn lỡ tay l&agrave;m rơi đồng hồ hay va chạm với c&aacute;c vật cứng kh&aacute;c. B&ecirc;n cạnh đ&oacute;, đồng hồ c&ograve;n đạt chứng nhận độ bền MIL-STD-810H n&ecirc;n bạn cứ y&ecirc;n t&acirc;m sử dụng ở nhiều điều kiện m&ocirc;i trường.</p>\n\n<p>Samsung Galaxy Watch6 Classic 47mm - Thiết kế</p>\n\n<p>Đồng hồ đ&atilde; được Samsung trang bị d&acirc;y Eco HyBrid với một lớp da phủ b&ecirc;n ngo&agrave;i, b&ecirc;n trong vẫn l&agrave; chất liệu l&agrave; silicone v&ocirc; c&ugrave;ng &ecirc;m &aacute;i, dẻo dai. D&acirc;y đồng hồ c&oacute; thể th&aacute;o rời n&ecirc;n bạn c&oacute; thể thay thế bằng nhiều loại d&acirc;y kh&aacute;c cho ph&ugrave; hợp với nhu cầu sử dụng v&agrave; sở th&iacute;ch. Một điểm thay đổi nhỏ ở phần thiết kế nữa l&agrave; tại khớp th&aacute;o d&acirc;y đồng hồ được trang bị một n&uacute;t nhấn cho thao t&aacute;c của bạn th&ecirc;m phần dễ d&agrave;ng v&agrave; nhanh ch&oacute;ng.</p>\n\n<p>Samsung Galaxy Watch6 Classic 47mm - D&acirc;y silicone phủ da</p>\n\n<p>Samsung Galaxy Watch6 Classic sử dụng tấm nền SUPER AMOLED với khả năng t&aacute;i hiện m&agrave;u sắc ch&iacute;nh x&aacute;c, độ tương phản cao sẽ đem lại những trải nghiệm xem tuyệt vời. K&iacute;ch thước m&agrave;n h&igrave;nh l&agrave; 1.5 inch cho kh&ocirc;ng gian hiển thị th&ecirc;m phần rộng r&atilde;i kết hợp với độ ph&acirc;n giải 480 x 480 pixels sẽ mang đến cho bạn những khung h&igrave;nh r&otilde; n&eacute;t.</p>\n\n<p>Samsung Galaxy Watch6 Classic 47mm - M&agrave;n h&igrave;nh cảm ứng</p>\n\n<p>Chăm s&oacute;c sức khỏe hiệu quả hơn nhờ c&ocirc;ng nghệ t&acirc;n tiến<br />\nỞ thế hệ n&agrave;y Samsung vẫn trang bị cảm biến 3 trong 1 BioActive gồm: Trở kh&aacute;ng điện sinh học (BIA), điện tim (ECG) v&agrave; nhịp tim quang học (HR) gi&uacute;p bạn ph&acirc;n t&iacute;ch c&aacute;c chỉ số cơ thể một c&aacute;ch nhanh ch&oacute;ng chỉ với một biết bị đeo tr&ecirc;n cổ tay. Khi nhịp tim của bạn thay đổi đột ngột, đồng hồ sẽ ph&aacute;t cảnh b&aacute;o để bạn nhận biết v&agrave; đưa ra những giải ph&aacute;p xử l&yacute; th&iacute;ch hợp, đảm bảo an to&agrave;n cả khi tập luyện v&agrave; nghỉ ngơi.</p>\n\n<p>Huấn luyện vi&ecirc;n giấc ngủ tr&ecirc;n đồng hồ th&ocirc;ng minh Samsung sẽ gi&uacute;p bạn tạo một th&oacute;i quen ngủ l&agrave;nh mạnh với đa dạng b&agrave;i hướng dẫn trực quan. Khi bạn bật chế độ ngủ, đồng hồ sẽ tắt t&iacute;nh năng nhận th&ocirc;ng b&aacute;o, đ&egrave;n LED xanh l&aacute; chuyển sang LED hồng ngoại (v&ocirc; h&igrave;nh) tạo một m&ocirc;i trường ngủ l&yacute; tưởng cho bạn. Khi bạn ngủ, đồng hồ sẽ tiến h&agrave;nh thu thập, ph&acirc;n t&iacute;ch dữ liệu v&agrave; b&aacute;o c&aacute;o th&ocirc;ng qua đ&oacute; bạn sẽ hiểu r&otilde; hơn về giấc ngủ của bản th&acirc;n.</p>\n\n<p>Samsung Galaxy Watch6 Classic 47mm - Trợ l&yacute; sức khỏe</p>\n\n<p>B&ecirc;n cạnh đ&oacute;, t&iacute;nh năng ph&aacute;t hiện t&eacute; ng&atilde; v&agrave; trợ gi&uacute;p SOS tr&ecirc;n đồng hồ th&ocirc;ng minh Samsung sẽ gi&uacute;p bạn nhận được sự trợ gi&uacute;p nhanh ch&oacute;ng trong những sự cố bất ngờ, an to&agrave;n hơn khi sinh sống hoặc tập luyện một m&igrave;nh.&nbsp;</p>\n\n<p>Lưu &yacute;: T&iacute;nh năng đo huyết &aacute;p v&agrave; điện t&acirc;m đồ ECG tr&ecirc;n đồng hồ chỉ hỗ trợ khi kết nối với điện thoại Samsung.</p>\n\n<p>Samsung Galaxy Watch6 Classic 47mm - Cảm biến sức khỏe</p>\n\n<p>Đa dạng chế độ thể thao, luyện tập hiệu quả<br />\nĐồng hồ th&ocirc;ng minh được trang bị 95 chế độ luyện tập từ c&aacute;c m&ocirc;n thể thao trong nh&agrave; đến ngo&agrave;i trời cho bạn thoải m&aacute;i lựa chọn. Trong l&uacute;c bạn tập luyện, đồng hồ sẽ ghi lại c&aacute;c th&ocirc;ng tin như nhịp tim, SpO2, calories ti&ecirc;u thụ, số bước ch&acirc;n, qu&atilde;ng đường chạy,... đều được ghi nhận. C&aacute;c số liệu n&agrave;y sẽ được lưu lại tr&ecirc;n đồng hồ gi&uacute;p bạn c&oacute; thể dễ d&agrave;ng theo d&otilde;i, từ đ&oacute; tiến h&agrave;nh điều chỉnh b&agrave;i tập cho ph&ugrave; hợp với thể trạng của bản th&acirc;n.&nbsp;</p>\n\n<p>Samsung Galaxy Watch6 Classic 47mm - Cải thiện hiệu suất luyện tập</p>\n\n<p>C&aacute; nh&acirc;n h&oacute;a v&ugrave;ng nhịp tim l&agrave; một t&iacute;nh năng mới của Samsung được t&iacute;ch hợp cho d&ograve;ng Galaxy Watch6 Classic hỗ trợ tốt hơn khi bạn tập luyện. V&ugrave;ng nhịp tim được chia l&agrave;m 5 v&ugrave;ng dựa tr&ecirc;n SpO2, nhịp tim, giới t&iacute;nh, chiều cao, c&acirc;n nặng v&agrave; độ tuổi của bạn. Ngo&agrave;i ra, chiếc đồng hồ n&agrave;y c&ograve;n c&oacute; Huấn luyện vi&ecirc;n ảo hỗ trợ bạn tập luyện đ&uacute;ng c&aacute;ch v&agrave; đạt hiệu quả tốt nhất.</p>\n\n<p>Đồng hồ th&ocirc;ng minh sở hữu nhiều cảm biến t&acirc;n tiến n&ecirc;n khả năng x&aacute;c định vị tr&iacute; của người d&ugrave;ng kh&aacute; ch&iacute;nh x&aacute;c, nhận t&iacute;n hiệu nhanh ch&oacute;ng v&agrave; c&oacute; độ ổn định cao hỗ trợ tốt hơn khi bạn tập luyện ở ngo&agrave;i trời hoặc tham gia c&aacute;c cuộc đua.</p>\n\n<p>Samsung Galaxy Watch6 Classic 47mm - Đa dạng m&ocirc;n thể thao</p>\n\n<p>Trải nghiệm liền mạch với hệ điều h&agrave;nh Wear OS<br />\nGalaxy Watch6 Classic sử dụng hệ điều h&agrave;nh Wear OS được t&ugrave;y biến bởi Samsung tạo n&ecirc;n một hệ sinh th&aacute;i liền mạch cho c&aacute;c thiết bị th&ocirc;ng minh của h&atilde;ng. Bạn c&oacute; thể sử dụng Google Maps trực tuyến, Trợ l&yacute; Google, kho ứng dụng Google Play, thanh to&aacute;n,... ngay tr&ecirc;n chiếc smartwatch của m&igrave;nh.</p>\n\n<p>Samsung Galaxy Watch6 Classic 47mm - Wear OS</p>\n\n<p>Đồng hồ c&oacute; khả năng kết nối ổn định th&ocirc;ng qua Bluetooth v5.3 với tốc độ đồng bộ nhanh ch&oacute;ng. Bạn c&oacute; thể nhận cuộc gọi v&agrave; trả lời c&aacute;c tin nhắn trực tiếp tr&ecirc;n Samsung Galaxy Watch6 Classic, kh&ocirc;ng sợ bỏ qua những th&ocirc;ng tin quan trọng. Bạn cần lưu &yacute;, chiếc đồng hồ kh&ocirc;ng tương th&iacute;ch với iPhone.</p>\n\n<p>Samsung Galaxy Watch6 Classic 47mm - Bluetooth v5.3</p>\n\n<p>Thời lượng sử dụng pin d&agrave;i, sạc nhanh ch&oacute;ng<br />\nVới phi&ecirc;n bản 47 mm, Samsung Galaxy Watch6 Classic sở hữu vi&ecirc;n pin 425 mAh cho bạn c&oacute; thể thoải m&aacute;i sử dụng trong khoảng 40 giờ (tắt Always-On-Display) m&agrave; kh&ocirc;ng cần sạc lại. Tốc độ sạc pin của đồng hồ cũng rất nhanh th&ocirc;ng qua đế sạc kh&ocirc;ng d&acirc;y, chỉ cần đợi 30 ph&uacute;t để sạc được 45% pin. Thời lượng pin thực tế của thiết bị sẽ bị ảnh hưởng bởi cường độ sử dụng của người d&ugrave;ng.</p>\n\n<p>Đồng hồ th&ocirc;ng minh Samsung đạt chuẩn kh&aacute;ng nước 5 ATM n&ecirc;n bạn kh&ocirc;ng cần phải th&aacute;o khi đi mưa, tắm, bơi ở v&ugrave;ng nước n&ocirc;ng,... sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng bạn trong nhiều hoạt động. Tuy nhi&ecirc;n, trong qu&aacute; tr&igrave;nh sử dụng bạn cần lưu &yacute; kh&ocirc;ng để đồng hồ tiếp x&uacute;c với nước n&oacute;ng, h&oacute;a chất, kh&ocirc;ng đeo khi v&agrave;o ph&ograve;ng x&ocirc;ng hơi,...</p>\n\n<p>Samsung Galaxy Watch6 Classic 47mm - Pin v&agrave; Kh&aacute;ng nước</p>\n\n<p>Những tiện &iacute;ch kh&aacute;c được t&iacute;ch hợp tr&ecirc;n đồng hồ<br />\nĐồng hồ th&ocirc;ng minh Samsung c&ograve;n được trang bị th&ecirc;m rất nhiều tiện &iacute;ch như điều khiển chơi nhạc, theo d&otilde;i h&agrave;nh tr&igrave;nh di chuyển qua GPS, b&aacute;o thức, đồng hồ bấm giờ, dự b&aacute;o thời tiết, v&iacute; điện tử Samsung Wallet,... hỗ trợ cho người d&ugrave;ng tốt hơn trong sinh hoạt thường ng&agrave;y.</p>\n\n<p>Samsung Galaxy Watch6 Classic 47mm - Tiện &iacute;ch kh&aacute;c</p>\n\n<p>Đồng hồ Samsung Galaxy Watch6 Classic 47mm sở hữu thiết kế tinh tế th&iacute;ch hợp với nhiều phong c&aacute;ch của người d&ugrave;ng. Đồng thời, thiết bị n&agrave;y c&ograve;n được trang bị nhiều chức năng sức khỏe, chế độ luyện tập v&agrave; một dung lượng pin lớn đồng h&agrave;nh c&ugrave;ng người d&ugrave;ng trong nhiều hoạt động. Đ&acirc;y sẽ l&agrave; sự lựa chọn tuyệt vời d&agrave;nh cho người y&ecirc;u th&iacute;ch c&ocirc;ng nghệ v&agrave; quan t&acirc;m đến việc chăm s&oacute;c cơ thể.',_binary '\0'),(108,'Đồng hồ thông minh Samsung Galaxy Watch6 LTE ',_binary 'data:image/jpeg;base64,','ON',15,'2023-11-01 18:56:09','2023-11-01 18:56:09','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary 'Samsung đ&atilde; tr&igrave;nh l&agrave;ng mẫu smartwatch mang t&ecirc;n Samsung Galaxy Watch6 LTE 44mm với hệ thống định vị ch&iacute;nh x&aacute;c, hỗ trợ nghe gọi độc lập, đa dạng t&iacute;nh năng sức khỏe v&agrave; thể thao, đ&aacute;p ứng nhiều mục đ&iacute;ch sử dụng của người d&ugrave;ng. Samsung đ&atilde; c&oacute; những thay đổi về ngoại h&igrave;nh lẫn t&iacute;nh năng b&ecirc;n trong hứa hẹn l&agrave;m h&agrave;i l&ograve;ng c&aacute;c t&iacute;n đồ y&ecirc;u c&ocirc;ng nghệ.&nbsp;<br />\nThiết kế thời thượng, năng động<br />\nSamsung Galaxy Watch6 sở hữu mặt đồng hồ h&igrave;nh tr&ograve;n quen thuộc với nhiều người d&ugrave;ng, ở thế hệ mới n&agrave;y phần viền sẽ được l&agrave;m mỏng hơn mang đến cảm gi&aacute;c liền mạch với khung viền hợp kim nh&ocirc;m xung quanh tạo n&ecirc;n một vẻ ngo&agrave;i sang trọng.</p>\n\n<p>Sử dụng mặt k&iacute;nh Sapphire cao cấp giảm t&igrave;nh trạng trầy xước, nứt vỡ trong qu&aacute; tr&igrave;nh sử dụng, cho khả năng bảo vệ m&agrave;n h&igrave;nh tốt hơn. Ngo&agrave;i ra, khả năng chống chịu t&aacute;c động từ m&ocirc;i trường của đồng hồ c&ograve;n được chứng minh khi đạt độ bền chuẩn qu&acirc;n đội MIL-STD-810H, bạn c&oacute; thể y&ecirc;n t&acirc;m sử dụng khi ở trong m&ocirc;i trường ẩm ướt, nhiều bụi bẩn,...&nbsp;</p>\n\n<p>Samsung Galaxy Watch6 LTE 44mm - Thiết kế thời thượng</p>\n\n<p>Chiếc đồng hồ th&ocirc;ng minh n&agrave;y được trang bị một m&agrave;n h&igrave;nh cảm ứng với k&iacute;ch thước 1.5 inch thuận tiện cho c&aacute;c thao t&aacute;c của người d&ugrave;ng. Độ ph&acirc;n giải 480 x 480 pixels sẽ cung cấp cho bạn những nội dung r&otilde; n&eacute;t với m&agrave;u sắc ch&acirc;n thật kể cả khi bạn sử dụng đồng hồ ở ngo&agrave;i trời.</p>\n\n<p>Sử dụng d&acirc;y đồng hồ silicone c&oacute; bề mặt mềm mịn, chịu lực tốt v&agrave; chống thấm nước n&ecirc;n bạn c&oacute; thể thoải m&aacute;i đeo tr&ecirc;n tay cả ng&agrave;y.&nbsp;</p>\n\n<p>Samsung Galaxy Watch6 LTE 44mm - D&acirc;y silicone</p>\n\n<p>Chăm s&oacute;c sức khỏe to&agrave;n diện<br />\nT&iacute;nh năng theo d&otilde;i giấc ngủ chuy&ecirc;n s&acirc;u tr&ecirc;n đồng hồ th&ocirc;ng minh Samsung sẽ gi&uacute;p bạn biết được thời gian ngủ s&acirc;u, ngủ n&ocirc;ng v&agrave; đ&aacute;nh gi&aacute; chất lượng giấc ngủ. Bạn cũng c&oacute; thể cải thiện chất lượng giấc ngủ th&ocirc;ng qua Huấn luyện vi&ecirc;n giấc ngủ được trang bị sẵn tr&ecirc;n đồng hồ, cơ thể sẽ được phục hồi tốt hơn sau một ng&agrave;y d&agrave;i l&agrave;m việc v&agrave; vận động.</p>\n\n<p>Đồng hồ th&ocirc;ng minh Samsung được trang bị cảm biến t&acirc;n tiến 3 trong 1 mang t&ecirc;n Samsung BioActive gồm: Trở kh&aacute;ng điện sinh học (BIA), điện tim (ECG) v&agrave; nhịp tim quang học (HR) gi&uacute;p ph&acirc;n t&iacute;ch c&aacute;c chỉ số một c&aacute;ch ch&iacute;nh x&aacute;c v&agrave; nhanh ch&oacute;ng gi&uacute;p bạn thấu hiểu cơ thể hơn.</p>\n\n<p>Samsung Galaxy Watch6 LTE 44mm - Chăm s&oacute;c sức khỏe</p>\n\n<p>B&ecirc;n cạnh đ&oacute;, đồng hồ c&ograve;n t&iacute;ch hợp th&ecirc;m những t&iacute;nh năng sức khỏe th&ocirc;ng dụng với người d&ugrave;ng như: Đo nhịp tim, theo d&otilde;i mức độ stress, đo huyết &aacute;p, điện t&acirc;m đồ, SpO2, lượng calories ti&ecirc;u thụ,... bạn c&oacute; thể kiểm tra c&aacute;c chỉ số sức khỏe bất cứ l&uacute;c n&agrave;o, v&ocirc; c&ugrave;ng thuận tiện.</p>\n\n<p>Lưu &yacute;: T&iacute;nh năng đo huyết &aacute;p v&agrave; điện t&acirc;m đồ ECG chỉ hỗ trợ khi kết nối với điện thoại th&ocirc;ng minh Samsung.</p>\n\n<p>Samsung Galaxy Watch6 LTE 44mm - Đo nhịp tim</p>\n\n<p>Tối ưu h&oacute;a việc luyện tập, chinh phục mọi thử th&aacute;ch<br />\nĐể đ&aacute;p ứng nhu cầu r&egrave;n luyện của người d&ugrave;ng, Samsung đ&atilde; trang bị cho chiếc đồng hồ n&agrave;y nhiều chế độ thể thao từ trong nh&agrave; cho đến ngo&agrave;i trời. B&ecirc;n cạnh đ&oacute;, huấn luyện vi&ecirc;n ảo tr&ecirc;n đồng hồ sẽ gi&uacute;p bạn x&aacute;c lập mục ti&ecirc;u, t&ugrave;y chỉnh cường độ tập luyện c&aacute; nh&acirc;n v&agrave; th&uacute;c đẩy luyện tập.</p>\n\n<p>Đồng hồ th&ocirc;ng minh đ&atilde; được Samsung trang bị nhiều cảm biến t&acirc;n tiến cho khả năng x&aacute;c định vị tr&iacute; của người d&ugrave;ng một c&aacute;ch ch&iacute;nh x&aacute;c, độ ổn định cao hỗ trợ tốt hơn khi bạn tập luyện những m&ocirc;n thể thao ngo&agrave;i trời.&nbsp;</p>\n\n<p>Samsung Galaxy Watch6 LTE 44mm - Hỗ trợ luyện tập</p>\n\n<p>Hệ điều h&agrave;nh Wear OS mượt m&agrave;, nhiều tiện &iacute;ch<br />\nTh&ocirc;ng qua hệ điều h&agrave;nh Wear OS gi&uacute;p smartwatch v&agrave; smartphone li&ecirc;n kết với nhau một c&aacute;ch to&agrave;n diện hơn, đem đến cho bạn những trải nghiệm tốt hơn. Bạn c&oacute; thể sử dụng Google Maps trực tuyến, Trợ l&yacute; Google, kho ứng dụng Google Play,... ngay tr&ecirc;n Galaxy Watch6 cho c&aacute;c trải nghiệm của bạn th&ecirc;m phần liền mạch.</p>\n\n<p>Lưu &yacute;: Đồng hồ kh&ocirc;ng tương th&iacute;ch với c&aacute;c thiết bị iPhone.</p>\n\n<p>Samsung Galaxy Watch6 LTE 44mm - Wear OS</p>\n\n<p>Đồng hồ th&ocirc;ng minh c&oacute; thể nghe gọi độc lập th&ocirc;ng qua eSIM v&ocirc; c&ugrave;ng tiện lợi cho những l&uacute;c đang bận hoặc qu&ecirc;n mang theo điện thoại. Ngo&agrave;i ra, bạn cũng c&oacute; thể trả lời tin nhắn ngay tr&ecirc;n đồng hồ, th&ocirc;ng b&aacute;o ứng dụng cũng được cập nhật nhanh ch&oacute;ng, bạn sẽ kh&ocirc;ng bỏ lỡ bất k&igrave; th&ocirc;ng tin quan trọng n&agrave;o.</p>\n\n<p>Samsung Galaxy Watch6 LTE 44mm - Nghe gọi với eSIM</p>\n\n<p>Đồng h&agrave;nh c&ugrave;ng người d&ugrave;ng ở mọi nơi<br />\nVới vi&ecirc;n pin 425 mAh, chiếc đồng hồ n&agrave;y c&oacute; thể hoạt động li&ecirc;n tục khoảng 40 giờ (khi tắt chế độ AOD - theo th&ocirc;ng tin h&atilde;ng c&ocirc;ng bố), thời gian nạp đầy năng lượng cho thiết bị n&agrave;y kh&aacute; nhanh, chỉ khoảng 30 ph&uacute;t cho 45% pin th&ocirc;ng qua đế sạc kh&ocirc;ng d&acirc;y, bạn sẽ kh&ocirc;ng phải chờ đợi qu&aacute; l&acirc;u để tiếp tục sử dụng.</p>\n\n<p>Đồng hồ th&ocirc;ng minh Samsung đạt hệ số kh&aacute;ng nước 5 ATM cho ph&eacute;p bạn thoải m&aacute;i đeo khi đi mưa, tắm, bơi ở v&ugrave;ng nước n&ocirc;ng,... m&agrave; kh&ocirc;ng lo nước l&agrave;m hỏng c&aacute;c bộ phận b&ecirc;n trong của thiết bị.</p>\n\n<p>Samsung Galaxy Watch6 LTE 44mm - &nbsp;Pin v&agrave; Kh&aacute;ng nước</p>\n\n<p>Đa dạng tiện &iacute;ch hỗ trợ người d&ugrave;ng<br />\nB&ecirc;n cạnh những chức năng về sức khỏe v&agrave; luyện tập thể thao th&igrave; chiếc đồng hồ th&ocirc;ng minh đến từ nh&agrave; Samsung n&agrave;y c&ograve;n được t&iacute;ch hợp rất nhiều tiện &iacute;ch để hỗ trợ người d&ugrave;ng trong sinh hoạt hằng ng&agrave;y như: T&igrave;m điện thoại, điều khiển chơi nhạc, dự b&aacute;o thời tiết, b&aacute;o thức, điều khiển chụp ảnh (tương th&iacute;ch với điện thoại Samsung từ d&ograve;ng Galaxy S9 trở l&ecirc;n), v&iacute; điện tử Samsung Wallet,&hellip;&nbsp;</p>\n\n<p>Samsung Galaxy Watch6 LTE 44mm - Nhiều tiện &iacute;ch kh&aacute;c</p>\n\n<p>Samsung Galaxy Watch6 LTE 44mm chắc chắn l&agrave; một thiết bị đeo th&ocirc;ng minh m&agrave; nhiều người d&ugrave;ng đang t&igrave;m kiếm bởi thiết kế v&ocirc; c&ugrave;ng thời thượng, đa dạng c&aacute;c t&iacute;nh năng hỗ trợ chăm s&oacute;c cơ thể tốt hơn.',_binary '\0'),(109,'Đồng hồ thông minh Samsung Galaxy Watch6 Classic',_binary 'data:image/jpeg;base64,','ON',15,'2023-11-01 18:58:54','2023-11-01 18:58:54','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary '>Trong sự kiện ra mắt sản phẩm thường ni&ecirc;n v&agrave;o th&aacute;ng 7/2023, b&ecirc;n cạnh c&aacute;c sản phẩm điện thoại lu&ocirc;n thu h&uacute;t sự ch&uacute; &yacute; của giới c&ocirc;ng nghệ, nh&agrave; Samsung cũng tr&igrave;nh l&agrave;ng thế hệ smartwatch mới của m&igrave;nh mang t&ecirc;n&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh/samsung-galaxy-watch6-classic-43mm\" target=\"_blank\" title=\"Samsung Galaxy Watch6 Classic 43mm kinh doanh tại Thế Giới Di Động \">Galaxy Watch6 Classic 43mm</a>.</h3>\n\n<h3>Trợ l&yacute; đắc lực trong việc chăm s&oacute;c v&agrave; cải thiện sức khỏe</h3>\n\n<p>Đồng hồ th&ocirc;ng minh sở hữu nhiều cảm biến cao cấp như cảm biến ph&acirc;n t&iacute;ch nhiệt độ, cảm biến BioActive,... cung cấp khả năng&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-do-nhip-tim\" target=\"_blank\" title=\"Tham khảo đồng hồ thông minh hỗ trợ đo nhịp tim tại Thegioididong.com\">đo nhịp tim</a>, huyết &aacute;p, SpO2, điện t&acirc;m đồ,... v&agrave;&nbsp;<strong>ph&acirc;n t&iacute;ch c&aacute;c th&agrave;nh phần cơ thể</strong>&nbsp;với 7 chỉ số gồm: chỉ số BMI, chỉ số BMR, c&acirc;n nặng, cơ xương, khối lượng mỡ, lượng mỡ cơ thể, lượng nước một c&aacute;ch ch&iacute;nh x&aacute;c.</p>\n\n<p>Lưu &yacute;: T&iacute;nh năng đo huyết &aacute;p v&agrave; điện t&acirc;m đồ ECG tr&ecirc;n đồng hồ chỉ hỗ trợ khi kết nối với điện thoại Samsung.</p>\n\n<p>H&atilde;ng c&ocirc;ng nghệ H&agrave;n Quốc cũng cung cấp&nbsp;<strong>Chương tr&igrave;nh Huấn luyện vi&ecirc;n giấc ngủ - Sleep Coaching</strong>&nbsp;được cải tiến tr&ecirc;n thiết bị, đưa ra những lời khuy&ecirc;n hữu &iacute;ch gi&uacute;p bạn n&acirc;ng cao chất lượng giấc ngủ của m&igrave;nh.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-sld-3.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy Watch6 Classic 43mm - Trợ lý sức khỏe\" src=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-sld-3.jpg\" title=\"Samsung Galaxy Watch6 Classic 43mm - Trợ lý sức khỏe\" /></a></p>\n\n<h3>Huấn luyện vi&ecirc;n ảo chuy&ecirc;n nghiệp tr&ecirc;n cổ tay</h3>\n\n<p>Để th&uacute;c đẩy việc luyện tập trở n&ecirc;n hiệu quả hơn, đồng hồ&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh-samsung-galaxy-watch-6-classichttps://www.thegioididong.com/dong-ho-thong-minh-samsung-galaxy-watch6-classic\" target=\"_blank\" title=\"Xem thêm mẫu đồng hồ thông minh Galaxy Watch6 đang bán tại thegioididong.com\">Samsung Galaxy Watch6 Classic</a>&nbsp;đ&atilde; trang bị&nbsp;<strong>95</strong>&nbsp;chế độ thể thao kh&aacute;c nhau như chạy bộ, nhảy d&acirc;y, yoga,... phục vụ đa dạng nhu cầu luyện tập của người d&ugrave;ng. Hơn nữa, thiết bị c&ograve;n đưa ra cho bạn c&aacute;c lời khuy&ecirc;n v&agrave; li&ecirc;n tục nhắc nhở bạn r&egrave;n luyện mỗi ng&agrave;y nhằm cải thiện thể chất, n&acirc;ng cao sức khỏe.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-12.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy Watch6 Classic 43mm - Cải thiện hiệu suất\" src=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-12.jpg\" title=\"Samsung Galaxy Watch6 Classic 43mm - Cải thiện hiệu suất\" /></a></p>\n\n<p>Chiếc smartwatch nh&agrave;&nbsp;<a href=\"https://www.thegioididong.com/samsung\" target=\"_blank\" title=\"Tham khảo các sản phẩm Samsung kinh doanh tại Thegioididong.com\" type=\"Tham khảo các sản phẩm Samsung kinh doanh tại Thegioididong.com\">Samsung</a>&nbsp;c&ograve;n được trang bị t&iacute;nh năng&nbsp;<strong>Chỉ số ph&acirc;n t&iacute;ch chạy bộ n&acirc;ng cao (Advanced Running Metrics)</strong>&nbsp;(Bất đối xứng - Asymetry, Thời gian chạm đất - Contact Time, Thời gian kh&ocirc;ng chạm đất - Flight Time, Mức đều đặn - Regularity, Dọc - Vertical, Độ căng cứng - Stiffness) gi&uacute;p bạn điều chỉnh tư thế, n&acirc;ng cao hiệu quả v&agrave; hạn chế khả năng chấn thương khi chạy bộ.</p>\n\n<p>Một t&iacute;nh năng ho&agrave;n to&agrave;n mới cũng được Samsung tr&igrave;nh l&agrave;ng đ&oacute; l&agrave;&nbsp;<strong>C&aacute; nh&acirc;n ho&aacute; v&ugrave;ng nhịp tim (Personalized HR Zone)</strong>, ph&acirc;n t&iacute;ch khả năng thể chất ri&ecirc;ng của người d&ugrave;ng v&agrave; x&aacute;c định năm mức chạy tối ưu gi&uacute;p bạn đặt mục ti&ecirc;u theo khả năng m&igrave;nh.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-sld-4.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy Watch6 Classic 43mm - Cải thiện hiệu suất\" src=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-sld-4.jpg\" title=\"Samsung Galaxy Watch6 Classic 43mm - Cải thiện hiệu suất\" /></a></p>\n\n<h3>Thiết kế tinh tế, m&agrave;n h&igrave;nh hiển thị đẹp xuất sắc</h3>\n\n<p>Galaxy Watch6 Classic mang diện mạo cổ điển nhưng kh&ocirc;ng k&eacute;m phần sang trọng, với viền bezel xoay vật l&yacute; được người d&ugrave;ng y&ecirc;u th&iacute;ch đ&atilde; được Samsung mang trở lại.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-sld-fix-2.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy Watch6 Classic 43mm - Thiết kế sang trọng\" src=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-sld-fix-2.jpg\" title=\"Samsung Galaxy Watch6 Classic 43mm - Thiết kế sang trọng\" /></a></p>\n\n<p>D&acirc;y đeo&nbsp;<strong>silicone</strong>&nbsp;c&oacute; thiết kế hybrid với việc&nbsp;<strong>phủ th&ecirc;m lớp da</strong>&nbsp;b&ecirc;n tr&ecirc;n bề mặt d&acirc;y, tạo điểm nhấn cho thiết bị nhưng vẫn đảm bảo tho&aacute;ng mồ h&ocirc;i cho cổ tay khi vận động.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Phần mặt k&iacute;nh được h&atilde;ng chế t&aacute;c từ chất liệu&nbsp;<strong>Sapphire</strong>&nbsp;cao cấp kết hợp với khung viền&nbsp;<strong>th&eacute;p kh&ocirc;ng gỉ</strong>&nbsp;bền bỉ, bảo vệ tốt hơn cho c&aacute;c chi tiết m&aacute;y b&ecirc;n trong, đồng thời cũng hạn chế tối đa t&igrave;nh trạng trầy xước, hư hỏng khi v&ocirc; t&igrave;nh xảy ra va quẹt.</p>\n\n<p><a href=\"https://www.thegioididong.com/dong-ho-thong-minh-samsung\" target=\"_blank\" title=\"Xem thêm các mẫu đồng hồ thông minh Samsung đang bán tại Thế Giới Di Động\">Đồng hồ th&ocirc;ng minh Samsung</a>&nbsp;mặt tr&ograve;n c&oacute; k&iacute;ch thước&nbsp;<strong>1.3 inch</strong>, độ ph&acirc;n giải&nbsp;<strong>432 x 432 pixels</strong>, hoạt động tr&ecirc;n tấm nền&nbsp;<strong>SUPER AMOLED</strong>&nbsp;mang đến cho bạn một kh&ocirc;ng gian hiển thị tuyệt đẹp, sắc n&eacute;t nhất trong bất cứ điều kiện &aacute;nh s&aacute;ng n&agrave;o.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-11.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy Watch6 Classic 43mm - Thiết kế cổ điển\" src=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-11.jpg\" title=\"Samsung Galaxy Watch6 Classic 43mm - Thiết kế cổ điển\" /></a></p>\n\n<h3>Hiệu năng vượt trội trong giới smartwatch</h3>\n\n<p><strong>Exynos W930</strong>&nbsp;l&agrave; con chip mới nhất d&agrave;nh cho d&ograve;ng Galaxy Watch được Samsung sản xuất bằng quy tr&igrave;nh 5 nm, cho tốc độ xử l&yacute; nhanh ch&oacute;ng c&aacute;c t&aacute;c vụ.&nbsp;</p>\n\n<p>Ngo&agrave;i ra, hệ điều h&agrave;nh Wear OS được t&ugrave;y biến bởi Samsung với giao diện&nbsp;<strong>One UI Watch</strong>&nbsp;mới cũng gi&uacute;p tối ưu h&oacute;a sự đồng bộ giữa c&aacute;c thiết bị Samsung với nhau, bạn c&oacute; thể thỏa sức c&agrave;i đặt c&aacute;c ứng dụng tr&ecirc;n Google Play, trải nghiệm kh&ocirc;ng giới hạn với chiếc Galaxy Watch của m&igrave;nh.</p>\n\n<p>Lưu &yacute;: Đồng hồ kh&ocirc;ng tương th&iacute;ch với c&aacute;c thiết bị iPhone.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-sld-5.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy Watch6 Classic 43mm - Hiệu năng mạnh mẽ\" src=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-sld-5.jpg\" title=\"Samsung Galaxy Watch6 Classic 43mm - Hiệu năng mạnh mẽ\" /></a></p>\n\n<h3>Thời lượng pin được cải tiến, chuẩn kh&aacute;ng nước 5 ATM</h3>\n\n<p>Với phi&ecirc;n bản 43 mm năm nay, Samsung đ&atilde; n&acirc;ng cấp cho đồng hồ một vi&ecirc;n pin lớn hơn với dung lượng&nbsp;<strong>300 mAh</strong>. T&ugrave;y theo c&aacute;c t&iacute;nh năng sử dụng sẽ cho thời lượng pin kh&aacute;c nhau.</p>\n\n<p>Bạn cũng kh&ocirc;ng cần phải lo lắng khi mang đồng hồ đi mưa, đi bơi ở v&ugrave;ng nước n&ocirc;ng,... nhờ chỉ số kh&aacute;ng nước&nbsp;<strong>5 ATM</strong>.&nbsp;</p>\n\n<p>Lưu &yacute;: Kh&ocirc;ng ấn c&aacute;c n&uacute;t điều chỉnh khi sử dụng trong ph&ograve;ng tắm hơi, tắm nước n&oacute;ng,...</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-sld-fix-7.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy Watch6 Classic 43mm - Pin và Kháng nước\" src=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-sld-fix-7.jpg\" title=\"Samsung Galaxy Watch6 Classic 43mm - Pin và Kháng nước\" /></a></p>\n\n<h3>Th&ecirc;m nhiều tiện &iacute;ch chờ bạn kh&aacute;m ph&aacute;</h3>\n\n<p>Ngo&agrave;i c&aacute;c t&iacute;nh năng cao cấp, chiếc&nbsp;<a href=\"https://www.thegioididong.com/dong-ho-thong-minh\" target=\"_blank\" title=\"Tham khảo đồng hồ thông minh kinh doanh tại Thegioididong.com\">đồng hồ th&ocirc;ng minh</a>&nbsp;n&agrave;y c&ograve;n sở hữu th&ecirc;m v&ocirc; v&agrave;n c&aacute;c tiện &iacute;ch như: B&aacute;o thức, thời tiết, điều khiển chụp ảnh (hỗ trợ điện thoại từ Galaxy S9 trở l&ecirc;n), v&iacute; điện tử Samsung Wallet, c&aacute; nh&acirc;n h&oacute;a mặt đồng hồ,... phục vụ tối ưu nhất cho người d&ugrave;ng trong c&aacute;c hoạt động hằng ng&agrave;y.</p>\n\n<p><a href=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-sld-8.jpg\" onclick=\"return false;\"><img alt=\"Samsung Galaxy Watch6 Classic 43mm - Tiện ích khác\" src=\"https://cdn.tgdd.vn/Products/Images/7077/310856/samsung-galaxy-watch6-classic-43mm-sld-8.jpg\" title=\"Samsung Galaxy Watch6 Classic 43mm - Tiện ích khác\" /></a></p>\n\n<p>Sở hữu những t&iacute;nh năng v&agrave; tiện &iacute;ch cao cấp, Galaxy Watch6 Classic 43mm xứng đ&aacute;ng l&agrave; trợ thủ đắc lực d&agrave;nh cho người d&ugrave;ng đang hướng tới một lối sống khỏe mạnh, tiện lợi v&agrave; th&ocirc;ng minh.',_binary '\0'),(110,'Huawei Watch GT 4 ',_binary 'data:image/webp;base64,','ON',17,'2023-11-01 19:03:23','2023-11-01 19:04:52','ADMIN','luongquyenct102@gmail.com',_binary '\0',_binary '>Đặc điểm nổi bật của&nbsp;Huawei Watch GT 4 46mm</h2>\n\n<p><strong>Với Huawei Watch GT 4 tr&ecirc;n cổ tay, bạn kh&ocirc;ng chỉ c&oacute; được m&oacute;n phụ kiện sang trọng m&agrave; c&ograve;n được hỗ trợ rất nhiều trong qu&aacute; tr&igrave;nh theo d&otilde;i sức khỏe, kết nối li&ecirc;n lạc v&agrave; tập luyện thể thao. Thời lượng sử dụng l&ecirc;n tới nửa th&aacute;ng gi&uacute;p người d&ugrave;ng thoải m&aacute;i trải nghiệm m&agrave; kh&ocirc;ng cần bận t&acirc;m nhiều về pin.</strong></p>\n\n<p><img alt=\"Huawei Watch GT 4 46mm\" src=\"https://images.fpt.shop/unsafe/filters:quality(90)/fptshop.com.vn/Uploads/images/2015/Tin-Tuc/05/02/Huawei-watch-gt-4-46mm-1.jpg\" /></p>\n\n<h3><strong>Viền bezel lịch thiệp, mặt đồng hồ cỡ lớn</strong></h3>\n\n<p>Phi&ecirc;n bản 46mm của Huawei Watch GT 4 được thiết kế để ph&ugrave; hợp với cổ tay ph&aacute;i mạnh. Sản phẩm theo đuổi phong c&aacute;ch lịch thiệp v&agrave; mang hơi hướng sang trọng, cao cấp. Cấu tr&uacute;c viền bezel tạo điểm nhấn mạnh mẽ về thị gi&aacute;c, kết hợp với n&uacute;t xoay vật l&yacute; được chế t&aacute;c tinh xảo mang lại cảm nhận g&oacute;c cạnh v&agrave; đầy l&ocirc;i cuốn.</p>\n\n<p>Ẩn trong mặt đồng hồ 46mm l&agrave; m&agrave;n h&igrave;nh rộng 1.43 inch với c&ocirc;ng nghệ AMOLED sắc sảo, hiển thị rất tốt dưới &aacute;nh nắng ngo&agrave;i trời. So với phi&ecirc;n bản trước, tỉ lệ m&agrave;n h&igrave;nh tr&ecirc;n th&acirc;n m&aacute;y của Huawei Watch GT 4 đ&atilde; được mở rộng th&ecirc;m 13% nhờ c&aacute;ch thiết kế r&uacute;t gọn viền bao quanh tinh tế.</p>\n\n<p><img alt=\"Huawei Watch GT 4 46mm 2\" src=\"https://images.fpt.shop/unsafe/filters:quality(90)/fptshop.com.vn/Uploads/images/2015/Tin-Tuc/05/02/Huawei-watch-gt-4-46mm-3.jpg\" /></p>\n\n<h3><strong>Giao diện phong ph&uacute;, dễ d&agrave;ng c&aacute; nh&acirc;n h&oacute;a</strong></h3>\n\n<p>Với Huawei Watch GT 4, bạn c&oacute; thể thoải m&aacute;i biến tấu giao diện hiển thị với 25.000 mặt đồng hồ kh&aacute;c nhau, từ phong c&aacute;ch đơn giản tới cầu kỳ. Đặc biệt, Huawei c&ograve;n cung cấp rất nhiều mặt đồng hồ Always On Display để bạn sử dụng một c&aacute;ch tiện lợi hơn, kh&ocirc;ng cần xoay cổ tay th&igrave; mới c&oacute; thể theo d&otilde;i th&ocirc;ng tin m&igrave;nh cần.</p>\n\n<p>Người d&ugrave;ng Huawei Watch GT 4 ho&agrave;n to&agrave;n thoải m&aacute;i trong việc c&aacute; nh&acirc;n h&oacute;a giao diện hiển thị dựa tr&ecirc;n ch&iacute;nh những &yacute; tưởng th&uacute; vị của m&igrave;nh. Chiếc smartwatch đ&atilde; cung cấp sẵn một chế độ để bạn lựa chọn từ kiểu d&aacute;ng, m&agrave;u sắc tới c&aacute;c chức năng hiển thị nhằm gi&uacute;p người d&ugrave;ng tự x&acirc;y dựng những mặt đồng hồ như &yacute; muốn.</p>\n\n<p><img alt=\"Huawei Watch GT 4 46mm 3\" src=\"https://images.fpt.shop/unsafe/filters:quality(90)/fptshop.com.vn/Uploads/images/2015/Tin-Tuc/05/02/Huawei-watch-gt-4-46mm-8.jpg\" /></p>\n\n<h3><strong>Cải thiện sức khỏe v&agrave; theo d&otilde;i Calories</strong></h3>\n\n<p>Nhằm th&ocirc;i th&uacute;c tinh thần vận động n&acirc;ng cao sức khỏe cho người d&ugrave;ng, Huawei Watch GT 4 mang lại chế độ&nbsp;<strong>V&ograve;ng hoạt động 2.0</strong>&nbsp;với khả năng nhận diện v&agrave; đo đạc c&aacute;c động t&aacute;c rất dễ thực hiện như&nbsp;<strong>Di Chuyển</strong>,&nbsp;<strong>Vận Động</strong>&nbsp;v&agrave;&nbsp;<strong>Đứng l&ecirc;n</strong>. Bạn c&oacute; thể thiết lập chỉ ti&ecirc;u vận động h&agrave;ng ng&agrave;y để cải thiện sức khỏe từng ch&uacute;t một.</p>\n\n<p>Th&ecirc;m v&agrave;o đ&oacute;, ứng dụng Stay Fit sẽ vận dụng c&ocirc;ng nghệ Huawei TruSeen 5.5+ một c&aacute;ch&nbsp;linh hoạt nhằm t&iacute;nh to&aacute;n chi tiết lượng calories bạn nạp v&agrave;o v&agrave; đốt được trong qu&aacute; tr&igrave;nh sinh hoạt v&agrave; tập luyện. Từ đ&oacute;, người d&ugrave;ng sẽ x&acirc;y dựng được phương &aacute;n ăn uống, thể thao v&agrave; nghỉ ngơi hợp l&yacute; h&agrave;ng ng&agrave;y.</p>\n\n<p><img alt=\"Huawei Watch GT 4 46mm 6\" src=\"https://images.fpt.shop/unsafe/filters:quality(90)/fptshop.com.vn/Uploads/images/2015/Tin-Tuc/05/02/Huawei-watch-gt-4-46mm-9.jpg\" /></p>\n\n<h3><strong>Tập luyện chuy&ecirc;n s&acirc;u, cảnh b&aacute;o kịp l&uacute;c</strong></h3>\n\n<p>Đeo Huawei Watch GT 4, thiết bị tr&ecirc;n cổ tay bạn sẽ li&ecirc;n tục theo d&otilde;i dữ liệu vận động khi bạn tham gia tập luyện c&aacute;c m&ocirc;n thể thao như b&oacute;ng đ&aacute;, b&oacute;ng rổ, đạp xe, đi bộ... Đặc biệt, tất cả tiến tr&igrave;nh chạy bộ đều được hướng dẫn tận t&igrave;nh qua chế độ giọng n&oacute;i để bạn nắm được c&aacute;c chỉ số cơ thể cũng như điều tiết tốc độ chạy sao cho hợp l&yacute; nhất.</p>\n\n<p>Với Huawei TruSeen 5.5+, Huawei Watch GT 4 sẽ nhắc nhở khi ph&aacute;t hiện c&aacute;c dấu hiệu bất thường của nhịp tim người d&ugrave;ng. Cảm biến thế hệ mới c&ugrave;ng thuật to&aacute;n hiện đại sẽ đưa ra cảnh b&aacute;o ch&iacute;nh x&aacute;c v&agrave; vận h&agrave;nh bền bỉ ngay cả trong m&ocirc;i trường lạnh gi&aacute;.</p>\n\n<p><img alt=\"Huawei Watch GT 4 46mm  20\" src=\"https://images.fpt.shop/unsafe/filters:quality(90)/fptshop.com.vn/Uploads/images/2015/Tin-Tuc/05/02/Huawei-watch-gt-4-46mm-5.jpg\" /></p>\n\n<h3><strong>Chăm s&oacute;c đời sống tinh thần của bạn</strong></h3>\n\n<p>Bạn sẽ c&oacute; c&ocirc;ng cụ tuyệt vời để hiểu s&acirc;u hơn về bản th&acirc;n, đồng thời chăm s&oacute;c sức khỏe tinh thần với c&ocirc;ng nghệ TruSeen 5.5+ v&agrave; TruSleep 3.0. C&ocirc;ng nghệ n&agrave;y cho ph&eacute;p Huawei Watch GT 4 thống k&ecirc; ch&iacute;nh x&aacute;c chỉ số SpO2, đ&aacute;nh gi&aacute; chất lượng giấc ngủ mỗi đ&ecirc;m v&agrave; hiểu được trạng th&aacute;i stress của m&igrave;nh.</p>\n\n<p>Th&ecirc;m v&agrave;o đ&oacute;, cảm biến PPG sẽ đưa ra th&ocirc;ng b&aacute;o nhanh ch&oacute;ng nếu nhận thấy c&aacute;c nguy cơ rung nhĩ hoặc suy tim. Chiếc đồng hồ sẽ gi&uacute;p bạn hiểu được mối li&ecirc;n hệ quan trọng của c&aacute;c chỉ số tim mạch tới sức khỏe tinh thần v&agrave; trạng th&aacute;i stress.</p>\n\n<p><img alt=\"Huawei Watch GT 4 46mm 10\" src=\"https://images.fpt.shop/unsafe/filters:quality(90)/fptshop.com.vn/Uploads/images/2015/Tin-Tuc/05/02/Huawei-watch-gt-4-46mm-a.jpg\" /></p>\n\n<h3><strong>Kết nối để nghe nhạc, li&ecirc;n lạc trong tầm tay</strong></h3>\n\n<p>Sau khi gh&eacute;p đ&ocirc;i Huawei Watch GT 4 với smartphone, sản phẩm sẽ hiển thị giao diện tr&ecirc;n mặt đồng hồ để bạn nhận hoặc hủy c&aacute;c cuộc gọi tới, đồng thời thống k&ecirc; nhật k&yacute; của cuộc gọi ngay tr&ecirc;n m&agrave;n h&igrave;nh hết sức tiện lợi.</p>\n\n<p>Trong trường hợp người d&ugrave;ng đồng bộ h&oacute;a danh s&aacute;ch nhạc từ smartphone v&agrave;o đồng hồ, Huawei Watch GT 4 c&oacute; thể truyền tải t&iacute;n hiệu nhạc trực tiếp tới tai nghe Bluetooth để bạn kh&ocirc;ng cần mang theo điện thoại khi chạy bộ m&agrave; vẫn thoải m&aacute;i tiếp th&ecirc;m động lực tập luyện th&ocirc;ng qua những ca kh&uacute;c s&ocirc;i động, hợp gu.',_binary '\0');
